INSERT INTO `t_article` VALUES ('0eccc6e67f3711e88536f792b715b318', '53cd9b1e78e411e89bb2538e3b767b5f', '习近平：大抓实战化军事训练 聚力打造精锐作战力量', '习近平：大抓实战化军事训练 聚力打造精锐作战力量', '0', '', '<h3 align=\"center\" style=\"text-align: center;\"><b><span><font face=\"Raleway\">习近平：大抓实战化军事训练</font> <font face=\"Raleway\">聚力打造精锐作战力量</font></span></b><b><span><o:p></o:p></span></b></h3><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">发布时间：</font>2018-01-03 02:33:00</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span><font face=\"微软雅黑\">来源：新华网</font></span><span><o:p></o:p></span></p><p class=\"p\" align=\"center\" style=\"text-align: center;\"><b><span class=\"15\"><font face=\"Open Sans\">习近平在视察中部战区陆军某师时强调</font></span></b><span><o:p></o:p></span></p><p class=\"p\" align=\"center\" style=\"text-align: center;\"><b><span class=\"15\"><font face=\"Open Sans\">大抓实战化军事训练</font></span></b><span><o:p></o:p></span></p><p class=\"p\" align=\"center\" style=\"text-align: center;\"><b><span class=\"15\"><font face=\"Open Sans\">聚力打造精锐作战力量</font></span></b><span><o:p></o:p></span></p><p class=\"p\"><span><font face=\"Open Sans\">　　新华社保定</font>1月4日电（记者曹智、李清华）中共中央总书记、国家主席、中央军委主席习近平3日视察中部战区陆军某师，强调要认真贯彻党的十九大精神，贯彻新时代党的强军思想，大抓实战化军事训练，深入推进数字化部队建设管理和作战运用创新，聚力打造精锐作战力量。习近平代表党中央和中央军委，向全体解放军指战员、武警部队官兵、民兵预备役人员致以新年祝福。</span><span><o:p></o:p></span></p><p class=\"p\" align=\"center\" style=\"text-align: center;\"><img src=\"http://120.77.43.199:9090/upload/file/1530673496747_%E5%9B%BE%E7%89%874.png\" alt=\"图片4.png\"><br></p><p class=\"p\"><span><font face=\"Open Sans\">　　</font></span><span>1月3日，中共中央总书记、国家主席、中央军委主席习近平视察中部战区陆军某师。这是习近平登上99A坦克，详细了解装备战技性能。新华社记者李刚摄</span><span><o:p></o:p></span></p><p class=\"p\"><span><font face=\"Open Sans\">　　新年伊始，燕赵大地，生机盎然。</font>3日上午10时30分许，习近平来到中部战区陆军某师。他首先察看了部队武器装备。数十台套数字化装备整齐列阵，威风凛凛，习近平边走边看，不时驻足询问。在地面突击系统装备前，习近平饶有兴致地登上99A坦克。这是我国自主研制的新一代主战坦克，有“陆战之王”美誉。在火力打击系统装备前，习近平登上红箭－10导弹发射车，详细了解装备战技性能。习近平强调，要抓住科技创新这个牛鼻子，把部队科技含量充分释放出来，把科技优势转化为能力优势、作战优势。</span><span><o:p></o:p></span></p><p class=\"p\"><span><font face=\"Open Sans\">　　随后，习近平来到侦察情报营训练场。该营侦察</font>2连是侦察英雄杨子荣生前所在连，被中央军委授予“英雄侦察连”荣誉称号。习近平仔细观看狙击手构筑工事和伪装训练，询问数字化单兵作战系统情况。看到侦察兵生龙活虎，训练有素，习近平很高兴。</span><span><o:p></o:p></span></p><p class=\"p\" align=\"center\" style=\"text-align: center;\"><img src=\"http://120.77.43.199:9090/upload/file/1530673505641_%E5%9B%BE%E7%89%875.png\" alt=\"图片5.png\"><br></p><p class=\"p\"><span><font face=\"Open Sans\">　　</font></span><span>1月3日，中共中央总书记、国家主席、中央军委主席习近平视察中部战区陆军某师。这是习近平同该师侦察英雄杨子荣生前所在连官兵亲切交谈。新华社记者李刚摄</span><span><o:p></o:p></span></p><p class=\"p\"><span><font face=\"Open Sans\">　　习近平对新入伍战士十分牵挂。训练场上，</font>2连新战士正在进行侦察格斗技能训练，习近平同他们亲切交流，详细询问有关情况。得知新战士中有不少小能人、小行家，有的是国家一级运动员，有的练过多年武术，在大型比赛中拿过奖牌，习近平点头称赞。战士徐大庆现场打了一套长拳，虎虎生风，赢得热烈掌声。习近平勉励他们苦练侦察本领，争取成为杨子荣式的侦察英雄。战士们提出想同习主席合个影，习近平高兴地把他们招拢过来，大家簇拥在习近平身旁，一张张青春的脸庞上写满了幸福和喜悦。分别的时候到了，全场官兵依依不舍送别习近平，高呼“听党指挥、能打胜仗、作风优良”，表达官兵坚决听习主席的话、做习主席的好战士的坚定决心。</span><span><o:p></o:p></span></p><p class=\"p\"><span><font face=\"Open Sans\">　　下午</font>3时许，习近平来到模拟训练中心，接见师机关全体干部和所属部队团以上干部，同大家亲切握手，合影留念。接着，习近平参观了师史馆。在一幅幅照片、一件件实物前，习近平看得很仔细。在反映该师抗美援朝战争期间激战松骨峰情况的展板前，习近平感慨地说，这一仗打得很激烈，官兵战斗作风很顽强。我军历来是打精气神的，过去钢少气多，现在钢多了，气要更多，骨头要更硬。</span><span><o:p></o:p></span></p><p class=\"p\"><span><font face=\"Open Sans\">　　随后，习近平听取了该师工作情况汇报，并发表重要讲话。他强调，要强化练兵备战，全部心思向打仗聚焦，各项工作向打仗用劲，加强数字化部队作战研究，创新作战概念和战法，大抓实战化军事训练，不断提高训练水平和打赢能力。要强化体系建设，统筹加强各种力量、各个系统、各类要素建设，加强信息系统和作战数据建设，确保成体系形成作战能力，有机融入全军联合作战体系。要强化改革创新，优化编成结构，加强科技运用，增强官兵科技素养，积极推进创新型人民军队实践探索。要强化政治保证，抓好党的十九大精神学习贯彻，贯彻古田全军政治工作会议精神，按照新时代党的建设总要求加强各级党组织建设，开展</font>“传承红色基因、担当强军重任”主题教育，确保部队坚决听从党中央和中央军委指挥。各级要高度重视数字化部队人才队伍建设，培养一批高素质新型军事人才。要满腔热忱为官兵办实事、解难事，坚决纠治基层官兵身边的“微腐败”和不正之风，把广大官兵积极性、主动性、创造性充分调动起来，共同把部队建设推向前进。</span><span><o:p></o:p></span></p><p class=\"p\"><span><font face=\"Open Sans\">　　中共中央政治局委员、中央军委副主席许其亮，中共中央政治局委员、中央军委副主席张又侠，中央军委委员魏凤和、李作成、苗华、张升民参加活动。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p>', '1', '2018-07-04 11:05', '80099', 'admin', '2018-07-04 11:05:08');
INSERT INTO `t_article` VALUES ('118af289a09511e8b73075cc6edb0d43', '23e3591067ba11e8a00ccf13631110e2', '【关注】军营版《一出好戏》震撼来袭！官兵看了都说好', '军营版《一出好戏》震撼来袭！官兵看了都说好', '1', 'https://mp.weixin.qq.com/s/x_yH6bj7fizmaVu1t5p02Q', '<br>', '1', '2018-08-15 22:11', '80099', 'admin', '2018-08-15 22:11:13');
INSERT INTO `t_article` VALUES ('124a25c47f5f11e88536e3db903f7ae4', '65acf33078e411e89bb28bb681c11dc5', '做红色传人 建强军新功', '做红色传人 建强军新功', '0', '', '<p class=\"p\" align=\"center\" style=\"text-align: center;\"><b><span><font face=\"微软雅黑\">做红色传人</font> <font face=\"微软雅黑\">建强军新功</font></span></b></p><p class=\"p\"><span>&nbsp;&nbsp;&nbsp;&nbsp; 坚定自觉听党指挥，从难从严苦练精训，英勇顽强除暴维稳，满腔赤忱爱民助民……武警西藏总队昌都支队特战一中队传承红色基因、擂响强军战鼓，部队建设全面进步全面过硬，不愧为“扎根雪域守护平安的英雄中队”。</span><span><o:p></o:p></span></p><p class=\"p\"><span>&nbsp;&nbsp;&nbsp;&nbsp; 红色基因是精神的谱系、信仰的种子，凝结着我军宝贵的品质，来之不易、弥足珍贵。回首来路，我军几经挫折而不断奋起、历尽苦难而淬火成钢，靠的是这种基因；迈步向前，我们保持冲锋陷阵的勇气、改天换地的志气，同样要靠红色基因的力量。特战一中队是一支英雄的部队。从抗联烽火到南疆硝烟，从陆军序列到武警建制，从改革前沿到雪域高原，编制、使命、环境虽然多次调整改变，但他们坚持把红色家谱装入行囊、将红色基因植入心田。正因为本色不变、初心不改，部队官兵人人做红色传人，始终鼓起信仰的风帆、保持前行的动力。</span><span><o:p></o:p></span></p><p class=\"p\"><span>&nbsp;&nbsp;&nbsp;&nbsp; 强国必先强军。当前，我军建设的历史方位、时代条件和使命任务发生了深刻变化，强军事业正处在爬坡过坎的关键期。没有勇担强军重任、勠力强军兴军的决心意志和本领，就跑不好自己这一棒、这一程。特战一中队牢记使命、磨砺“拳头”，按照源于实战、高于实战、严于实战的要求精武强能，苦练反恐作战本领，在一次次任务检验、一场场战斗交锋中交出优异答卷。向特战一中队学习，就要坚定强军信念、投身强军实践、提升强军本领，使中国特色强军之路越走越宽广。</span><span><o:p></o:p></span></p><p class=\"p\"><span>&nbsp;&nbsp;&nbsp;&nbsp; “榜样是看得见的哲理。”特战一中队是强军兴军伟大事业催生的时代标杆，是强军兴军征途上涌现的先锋模范。实现党在新时代的强军目标，把人民军队全面建成世界一流军队，使命在肩，号角催征。我们必须用习近平强军思想武装头脑，扎实搞好“传承红色基因、担当强军重任”主题教育，永葆初心本色、苦干强军事业，以永不懈怠的精神状态和一往无前的奋斗姿态，在新时代不断书写强军兴军新篇章。</span><span><o:p></o:p></span></p>', '1', '2018-07-04 15:51', '80099', 'admin', '2018-07-04 15:51:34');
