INSERT INTO `t_article` VALUES ('3e0261377f9811e88536cf0a7d6ce4a6', '5bbadf4f78e411e89bb239f8d1ad2a7b', '开展“传承红色基因担当强军重任”主题教育的意见', '展“传承红色基因担当强军重任”主题教育的意见', '0', '', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align: center;\"><span><font face=\"微软雅黑\">中央军委办公厅印发《关于在全军开展</font>“传承红色基因、担当强军重任”主题教育的意见》</span></p><p class=\"p\"><span><font face=\"宋体\">　　解放军报北京</font>3月16日电 经中央军委批准，中央军委办公厅近日印发《关于在全军开展“传承红色基因、担当强军重任”主题教育的意见》。</span><span><o:p></o:p></span></p><p class=\"p\"><span>　　《意见》指出，要把学习贯彻习近平新时代中国特色社会主义思想作为核心内容和根本任务，贯彻学懂弄通做实要求，认真组织学习教育、开展实践活动、加强检查督导等，切实拎起教育的魂和纲，在高举思想旗帜、培育时代新人上取得扎实成效。要突出学好习近平强军思想，牢固确立在国防和军队建设中的指导地位，学习贯彻全面推进国防和军队现代化的战略部署，增强投身强军事业的政治自觉和行动自觉。</span><span><o:p></o:p></span></p><p class=\"p\"><span>　　《意见》强调，要紧密结合新的形势任务要求，抓住事关永葆我军性质宗旨本色、有效履行新时代军队使命任务的根本性全局性问题，抓住官兵关注的重大理论和现实问题，聚焦备战打仗，设置专题加强针对性教育和思想引导。</span><span><o:p></o:p></span></p><p class=\"p\"><span><font face=\"宋体\">　　《意见》强调，要以更高标准、更严要求抓好党员干部特别是团以上领导干部学习教育，严格组织生活制度，从严查纠党员队伍中存在的思想不纯、组织不纯、作风不纯等突出问题，着力纠治形式主义和官僚主义，全面彻底肃清郭伯雄、徐才厚流毒影响。构建积极健康的党内政治文化，培育争做</font>“四个合格”党员的新风尚。坚持党建带团建，教育引导广大团员青年放飞青春梦想、勇担强军重任。</span><span><o:p></o:p></span></p><p class=\"p\"><span>　　《意见》要求，各级要切实把主题教育摆在突出位置，加大领导和统筹力度，认真筹划设计，加强具体指导，把严实要求贯穿教、学、做各个环节，抓实思想调查，坚持领导带头，改进创新教育形式方法，推动教育展现新风新貌。严格检查督导，确保教育落到实处。</span><span><o:p></o:p></span></p>', '1', '2018-07-04 22:40', '80099', 'admin', '2018-07-04 22:40:48');
INSERT INTO `t_article` VALUES ('43c013897ebd11e885361d1073af1d46', '4bd2df847e7e11e88536436658d7fe9f', '@上次受邀来营的家长们，你们的孩子下连满月啦', '枕戈观澜', '1', 'https://mp.weixin.qq.com/s/a_XRlvZMMKLZ2CVK9SSy_A', '', '1', '2018-07-03 20:33', '80099', 'admin', '2018-07-03 20:33:18');
INSERT INTO `t_article` VALUES ('44cea2d0802811e88536dfd661c96c5c', '28468c2167ba11e8a00c93c0b789c0b8', '“传承红色基因 担当强军重任”主题教育理论抽考', '“传承红色基因 担当强军重任”主题教育理论抽考', '0', null, '<p class=\"MsoNormal\" style=\"text-align: center; \"><span>“传承红色基因 担当强军重任”主题教育第一专题理论抽考</span><span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: left;\"><span>&nbsp; &nbsp; &nbsp; &nbsp;5月8日下午，为摸清旅队官兵对主题教育理论知识掌握程度，驻闽某旅组织“传承红色基因 担当强军重任”主题教育第一专题理论抽考。据悉，此次抽考对象主要是面向小散远点以及值班执勤点官兵。为确保考核公平公正，考出真实成绩，反应实际掌握情况，考核采用全程录像。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: left;\"><span>&nbsp; &nbsp; &nbsp; &nbsp;考核结束后，官兵纷纷表示，随机抽考更能反映出基层官兵对主题教育理解掌握情况，能够起到很好的督学促学效果。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><!--[if !supportLists]--><span></span><img src=\"http://120.77.43.199:9090/upload/file/1530777043396_DSC_1490.jpg\" alt=\"DSC_1490.jpg\"><span></span><span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><span>考官明确考核要求</span><span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><!--[if !supportLists]--><span></span><img src=\"http://120.77.43.199:9090/upload/file/1530777052916_DSC_1495.jpg\" alt=\"DSC_1495.jpg\"><span></span><span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: center;\"><span>官兵认真答题</span><span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><!--[if !supportLists]--><span></span><img src=\"http://120.77.43.199:9090/upload/file/1530777059686_DSC_1507.jpg\" alt=\"DSC_1507.jpg\"><span></span><span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><span>考核现场</span><span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><!--[if !supportLists]--><span></span><img src=\"http://120.77.43.199:9090/upload/file/1530777067031_DSC_1498.jpg\" alt=\"DSC_1498.jpg\"><span></span><span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: center; \"><span>全程录像</span><span><o:p></o:p></span></p>', '1', '2018-07-05 15:51', '80099', 'admin', '2018-07-05 15:51:47');
