INSERT INTO `t_article` VALUES ('5ebdf41ceed211e88fc6e5ca481aab27', '4bd2df847e7e11e88536436658d7fe9f', '回答', '北岛现在诗', '0', '', '<p><span>卑鄙是卑鄙者的通行证，</span><br><span>高尚是高尚者的墓志铭，</span><br><span>看吧，在那镀金的天空中，</span><br><span>飘满了死者弯曲的倒影。</span><br><br><span>冰川纪过去了，</span><br><span>为什么到处都是冰凌？</span><br><span>好望角发现了，</span><br><span>为什么死海里千帆相竞？</span><br><br><span>我来到这个世界上，</span><br><span>只带着纸、绳索和身影，</span><br><span>为了在审判之前，</span><br><span>宣读那些被判决的声音。</span><br><br><span>告诉你吧，世界</span><br><span>我--不--相--信！</span><br><span>纵使你脚下有一千名挑战者，</span><br><span>那就把我算作第一千零一名。</span><br><br><span>我不相信天是蓝的，</span><br><span>我不相信雷的回声，</span><br><span>我不相信梦是假的，</span><br><span>我不相信死无报应。</span><br><br><span>如果海洋注定要决堤，</span><br><span>就让所有的苦水都注入我心中，</span><br><span>如果陆地注定要上升，</span><br><span>就让人类重新选择生存的峰顶。</span><br><br><span>新的转机和闪闪星斗，</span><br><span>正在缀满没有遮拦的天空。</span><br><span>那是五千年的象形文字，</span><br><span>那是未来人们凝视的眼睛。</span></p>', '1', '2018-11-23 11:46', '80099', 'admin', '2018-11-23 11:46:33');
