adding: 0px;\"><h1 class=\"big_title\" style=\"word-wrap: break-word; margin-top: 0.32rem; margin-bottom: 0px; padding: 0px; font-size: 0.6rem; color: rgb(51, 51, 51); font-weight: bold;\">树立正确“三观”，把好人生价值观</h1><h2 class=\"small_title\" style=\"word-wrap: break-word; margin: 0.3rem 0px 0px; padding: 0px 0px 0.43rem; font-size: 0.48rem; color: rgb(51, 51, 51); border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(231, 214, 195);\">香格里拉市综合行政执法局 和治利</h2></div><div id=\"post_1364708\" style=\"word-wrap: break-word; margin: 0px; padding: 0px;\"><div id=\"font_area\" class=\"font_area_mid\" style=\"word-wrap: break-word; margin: 0px; padding: 0px; color: rgb(76, 76, 76); font-family: 微软雅黑; font-size: 0px; line-height: 0px;\"><div class=\"con\" style=\"word-wrap: break-word; margin: 0px auto; padding: 0px; width: 335.875px;\"><div class=\"word\" style=\"word-wrap: break-word; margin: 0.53rem 0px 0px; padding: 0px; font-size: 18px; color: rgb(51, 51, 51); line-height: 42px;\"><div align=\"left\" style=\"word-wrap: break-word; margin: 0px; padding: 0px;\">习总书记曾说：“党员干部要加强党性修养和锻炼，牢固树立正确的世界观、权力总 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 习近平书记曾说：“党员干部要加强党性修养和锻炼，牢固树立正确的世界观、权力观、事业观，坚定崇高理想，坚持立党为公、执政为民，尽心尽力干好工作。”“三观”问题决定着为官者仕途上的追求和方向，反映着个人的思想境界、道德情操和行为准则。在新的形势下，党员的先进性需要正确的世界观、人生观和价值观来支撑。如何看待权力、地位和政绩，对于党员干部来说，具有重要的现实意义，要真正做到权为兵所用，利为兵所谋，情为兵所系，就必须把握时代节奏，正好人生“三观”。</div><div align=\"left\" style=\"word-wrap: break-word; margin: 0px; padding: 0px;\">&nbsp; &nbsp; &nbsp; &nbsp; “勿以善小而不为、勿以恶小而为之”。干部也是军人，也是在既定的社会人，“不以规矩，不能成方圆，”那就要遵守规则。干部起着先锋带头作用，所以干部更应该严格要求自己，严格约束自己，努力提高自身的思想素质和道德素质。既然是单位的领导，是中国共产党员，就要以党章的要求严格要求自己，不贪小便宜，努力纯洁我们的党员干部队伍。</div><div align=\"left\" style=\"word-wrap: break-word; margin: 0px; padding: 0px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;做人为先，谨树道德观。俗语“君子有九思：视思明，听思聪，色思温，貌思恭，言思忠，事思敬，疑思问，忿思难，见得思义”，讲的就是做人的道理和道德修养的问题。“修身、正己、立德”是中华民族人之大本的最高提炼，也是带兵打仗的根本指导。连队党支部要求全体党员干部要切实践行以“为兵、务实、清廉”为核心的“官德”要求，时刻以“君子检身，常若有过”的谦诚态度反省自己的言行，始终做到生活正派、情趣健康，把党和人民的事业放在首位，把官兵所需放在第一，不计较、不攀比、不失衡，经受得住各种考验。</div><div align=\"left\" style=\"word-wrap: break-word; margin: 0px; padding: 0px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;养性为先，勤树得失观。人生不如意十之八九，每个人都不可能事事顺心，得意与失意总是错综复杂，轮回流转。怎样看待得失，是当下领导干部亟需解决的问题。正确得失观的树立，需要保持良好的心态。当前，我国正处于社会发展的转型关键时期，经济的飞速发展，各种糖衣炮弹扑面而来，作为党的干部就应该保持“得之淡然，失之坦然”的良好心态，培养高层次的思想境界，遇“得”要知足常乐；遇“失”当坦然处之，保持积极的好心态，树立正确的得失观，从患得患失中跳出来，做到“不以物喜，不以己悲”，经受住考验。只有保持一颗谨慎之心、律己之心，以正确的态度去论自己的荣辱得失。</div><div align=\"left\" style=\"word-wrap: break-word; margin: 0px; padding: 0px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;士兵为先，牢树群众观。要以“焦裕禄精神”为鉴，重心下移，把实现好、维护好群众的根本利益作为工作的根本出发点，经常走走、转转、看看，多深入班排、深入兵中，俯下身子、放下架子，从群众中汲取智慧和力量，并竭尽所能为战士排忧解难。要时刻不忘加强自身修养，努力提高从政意识和为兵服务的能力、水平，把个人的追求融入服务官兵的事业之中，始终把战士利益放在第一位。同时，要把廉洁自律作为一种思想境界来提升，作为一种职业操守来要求，作为一种工作能力来培养，牢固树立正确的世界观、人生观、价值观，权利观、利益观、地位观，追求积极向上的生活情趣，带头弘扬社会主义道德风尚，时时处处作好表率，树立起廉洁自律的干部队伍良好形象。</div><p style=\"word-wrap: break-word; margin-top: 0.5rem; margin-bottom: 0px; padding: 0px; line-height: 0.8rem; font-size: 0.4rem;\"></p></div></div></div><div class=\"vspace\" style=\"word-wrap: break-word; margin: 0px; padding: 0px; height: 10px; font-size: 0px; line-height: 0px; width: 332.515625px; clear: both; overflow: hidden; color: rgb(76, 76, 76); font-family: 微软雅黑;\"></div><div class=\"title_bottom title_mobile_bottom\" style=\"word-wrap: break-word; margin: 22px 0px 0px; padding: 0px; width: 335.875px; border-bottom-style: none; height: 48px; line-height: 48px; display: none; color: rgb(76, 76, 76); font-family: 微软雅黑; font-size: 0px;\"><span class=\"time\" style=\"word-wrap: break-word; margin: 0px 25px 0px 0px; padding: 0px; color: rgb(102, 102, 102); font-size: 0.28rem; float: left; width: 335.875px; line-height: 0.52rem; display: block !important;\">阅读人次：6900</span><span class=\"time_ren\" style=\"word-wrap: break-word; margin: 0px 25px 0px 0px; padding: 0px; color: rgb(102, 102, 102); font-size: 0.28rem; float: left; width: 335.875px; line-height: 0.52rem; display: block !important;\">发布人：<a href=\"http://tougao.12371.cn/zuopin.php?uid=30531353\" style=\"word-wrap: break-word; margin: 0px; padding: 0px; color: rgb(9, 103, 156);\">迪祖轩</a></span><span class=\"time\" style=\"word-wrap: break-word; margin: 0px 25px 0px 0px; padding: 0px; color: rgb(102, 102, 102); font-size: 0.28rem; float: left; width: 335.875px; line-height: 0.52rem; display: block !important;\">发布时间：2017-5-29 15:36</span><div class=\"vspace\" style=\"word-wrap: break-word; margin: 0px; padding: 0px; height: 10px; line-height: 0px; width: 332.515625px; clear: both; overflow: hidden;\"></div><div class=\"clear\" style=\"word-wrap: break-word; margin: 0px; padding: 0px; clear: both; font-size: 1px; line-height: 1px; height: 1px; overflow: hidden;\"></div></div></div></div></div>', null);
INSERT INTO `t_chatgroup_details_temp` VALUES ('0e632e0eb4d311e89f0f2b3e14eb66b0', '继续测试', '<div style=\"text-align: center;\">6月6日，习近平主席在北京人民大会堂东门外举行仪式，欢迎前来访问的吉尔吉斯斯坦总统，标志着“上合时间”拉开了序幕。</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\">△6月6日，习近平主席在人民大会堂东门外广场为吉尔吉斯斯坦总统热恩别科夫举行欢迎仪式。这也是改革后的国事访问欢迎仪式首次亮相。（图 / 新华社）</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\">紧接着，上合组织其他七个成员国、四个观察员国、六个对话伙伴的国家领导人，以及国际组织负责人，相继抵达北京和青岛。<img src=\"http://120.77.43.199:9090/upload/file/1536567921666_20180910162457.JPG\" alt=\"http://120.77.43.199:9090/upload/file/1536567921666_20180910162457.JPG\" style=\"line-height: 1.42857143; max-width: 100%;\"></div>', null);
