INSERT INTO `t_chatgroup_details_temp` VALUES ('ce376a3db4d211e89f0f9bd4f3159cd0', '模拟课程', '<div>6月6日，习近平主席在北京人民大会堂东门外举行仪式，欢迎前来访问的吉尔吉斯斯坦总统，标志着“上合时间”拉开了序幕。</div><div><br></div><div><br></div><div>△6月6日，习近平主席在人民大会堂东门外广场为吉尔吉斯斯坦总统热恩别科夫举行欢迎仪式。这也是改革后的国事访问欢迎仪式首次亮相。（图 / 新华社）</div><div><br></div><div>紧接着，上合组织其他七个成员国、四个观察员国、六个对话伙伴的国家领导人，以及国际组织负责人，相继抵达北京和青岛。</div>', null);
