INSERT INTO `t_discovery` VALUES ('315', '54564', '0', '监控', 'http://120.77.43.199:9090/upload/images/picture/1505387541532_1505387539013656.jpg,http://120.77.43.199:9090/upload/images/picture/1505387541533_1505387539316812.jpg,http://120.77.43.199:9090/upload/images/picture/1505387541533_1505387539600486.jpg', null, null, null, null, null, null, '2017-09-14 19:12:21', '2017-09-14 19:12:21', '999', '999');
INSERT INTO `t_discovery` VALUES ('323', '54564', '0', '高层动态干部论坛人事反腐党建音频视频云平台\n领导活动时代先锋理论评论党史综合社区对党说\n\n坚持党的领导首先是坚持党中央的集中统一领导\n\n谢春涛\n\n2016年12月21日09:26    来源：经济日报\n\n原标题：坚持党的领导首先是坚持党中央的集中统一领导\n\n　　党的十八届六中全会通过的《关于新形势下党内政治生活的若干准则》强调：“坚持党的领导，首先是坚持党中央的集中统一领导。”“坚决维护党中', null, null, null, null, null, null, null, '2017-09-14 19:14:40', '2017-09-14 19:14:40', '1000', '999');
INSERT INTO `t_discovery` VALUES ('324', '54564', '0', '坚持党的领导，首先是坚持党中央的集中统一领导。一个国家、一个政党，领导核心至关重要。全党必须\n\n坚持党的领导，首先是坚持党中央的集中统一领导。一个国家、一个政党，领导核心至关重要。全党必须牢固树立政治意识、大局意识、核心意识、看齐意识，自觉在思想上政治上行动上同 保持高度一致。（)\nA.党中央\nB.党组织\nC.领导干部', null, null, null, null, null, null, null, '2017-09-14 19:15:36', '2017-09-14 19:15:36', '999', '999');
INSERT INTO `t_discovery` VALUES ('326', '54564', '0', '新华社北京12月27日电  《关于新形势下党内政治生活的若干准则》提出：“党的组织生活是党内政治生活的重要内容和载体，是党组织对党员进行教育管理监督的重要形式。”鲜明阐述了党的组织生活在党内政治生活中的基础性地位和作用，为严肃党内政治生活，推进党内生活科学化，明确了重要抓手，指明了努力方向', null, null, null, null, null, null, null, '2017-09-14 19:17:07', '2017-09-14 19:17:07', '999', '999');
INSERT INTO `t_discovery` VALUES ('328', '54564', '0', '注重党的组织生活和严格党内政治生活，是马克思主义政党加强党的建设的优良传统，也是马克思主义政党始终保持先进性纯洁性和创造力凝聚力战斗力的一个法宝。中国共产党自建党之日起，一直高度重视党的组织生活，着力建设良好党内政治关系。党的二大通过的第一部党章，就对党的组织生活作出规定。新中国成立后，党的组织生活不断制度化、规范化。', null, null, null, null, null, null, null, '2017-09-14 19:17:53', '2017-09-14 19:17:53', '999', '999');
INSERT INTO `t_discovery` VALUES ('329', '54564', '0', '注重党的组织生活和严格党内政治生活，是马克思主义政党加强党的建设的优良传统，也是马克思主义政党始终保持先进性纯洁性和创造力凝聚力战斗力的一个法宝。中国共产党自建党之日起，一直高度重视党的组织生活，着力建设良好党内政治关系。党的二大通过的第一部党章，就对党的组织生活作出规定。新中国成立后，党的组织生活不断制度化、规范化。注重党的组织生活和严格党内政治生活，是马克思主义政党加哦破Mrsmorphosi', null, null, null, null, null, null, null, '2017-09-14 19:21:01', '2017-09-14 19:21:01', '999', '999');
INSERT INTO `t_discovery` VALUES ('330', '54564', '0', '我们是共产主义接班人', 'http://120.77.43.199:9090/upload/images/picture/1505388287396_1505388283114760.jpg,http://120.77.43.199:9090/upload/images/picture/1505388287396_1505388283455187.jpg,http://120.77.43.199:9090/upload/images/picture/1505388287397_1505388283701165.jpg,http://120.77.43.199:9090/upload/images/picture/1505388287397_1505388283924913.jpg,http://120.77.43.199:9090/upload/images/picture/1505388287397_1505388284164643.jpg,http://120.77.43.199:9090/upload/images/picture/1505388287397_150538828448289.jpg,http://120.77.43.199:9090/upload/images/picture/1505388287398_1505388284743444.jpg,http://120.77.43.199:9090/upload/images/picture/1505388287398_1505388284986288.jpg', null, null, null, null, null, null, '2017-09-14 19:24:47', '2017-09-14 19:24:47', '999', '999');
INSERT INTO `t_discovery` VALUES ('331', '54564', '0', '党的组织生活作为党的思想教育和组织管理的重要形式，是严格党内政治生活的基本载体，必须体现鲜明的政治性，紧紧围绕保持党的先进性和纯洁性来进行。党的建设的重要任务就是坚持用马克思主义科学理论武装全党，不断清除党内各种错误思想，始终保持党的性质和宗旨不变，保持共产党人清正廉洁的人民公仆政治本色不变。', null, null, null, null, null, null, null, '2017-09-14 19:26:12', '2017-09-14 19:26:12', '999', '999');
INSERT INTO `t_discovery` VALUES ('332', '54563', '0', '粉碎“四人帮”后，社会上和党内出现一些思想动向，造成了一部分人思想混乱。针对这种情况，1979年3月30日，邓小平代表中共中央在北京召开的理论工作务虚会上作了题为《坚持四项基本原则》的讲话。邓小平在讲话中提出必须坚持的“四项基本原则”。即“第一，必须坚持社会主义道路；第二，必须坚持无产阶级专政（1982年华国锋同志辞去中共中央主席后，邓小平同志将《中华人民共和国宪法》中的无产阶级专政改为人民民主专', null, null, null, null, null, null, null, '2017-09-14 19:28:49', '2017-09-14 19:28:49', '999', '999');
INSERT INTO `t_discovery` VALUES ('333', '54564', '1', '分享', null, 'http://resource.gbxx123.com/site/image/courseware/2017/9/12/1505194917281.jpg', '习近平致《联合国防治荒漠化公约》第十三次缔约方大会高级别会议的贺信', '值此《联合国防治荒漠化公约》第十三次缔约方大会高级别会议开幕之际，我谨代表中国政府和中国人民，向会议的召开致以热烈的祝贺！向出席会议的各国代表、国际机构负责人和各界人士致以诚挚的欢迎！', 'http://resource.gbxx123.com/book/epubs/2017/9/11/1505117403167/ops/chapter1.html', '7', '216', '2017-09-14 19:45:05', '2017-09-14 19:45:05', '999', '999');
INSERT INTO `t_discovery` VALUES ('334', '54564', '1', '分享给你', null, 'http://resource.gbxx123.com/site/image/courseware/2017/9/9/1504963795232.jpg', '全球金融治理格局', '全球金融治理是指主权国家、政府间金融监管机构和国际金融组织等组织机构为建立或维持理想国际金融秩序，通过多边或双边、正式或非正式的协调、合作、确立共识等方式管理全球金融事务的行为。全球金融治理格局即全球金融治理的局势、态势。2016年9月3日，习近平在二十国集团工商峰会开幕式上提出：二十国集团应共同构建公正高效的全球金融治理格局，维护世界经济稳定大局。', 'http://resource.gbxx123.com/book/epubs/2017/9/9/1504963587653/ops/chapter1.html', '7', '217', '2017-09-14 19:47:55', '2017-09-14 19:47:55', '999', '999');
INSERT INTO `t_discovery` VALUES ('335', '54564', '1', '分享', null, 'http://xxzlres.xxzg123.com/images/km/9.jpg', '未来简史', '《未来简史》进一步探讨了人类未来的命运。进入21世纪后，曾经长期威胁人类生存、发展的瘟疫、饥荒和战争已经被攻克，智人面临着新的待办议题：永生不老、幸福快乐和成为具有“神性”的人类。在解决这些新问题的过程中，科学技术的发展将颠覆我们很多当下认为无需佐证的“常识”，比如人文主义所推崇的自由意志将面临严峻挑战，机器将会代替人类做出更明智的选择。更重要的，当以大数据、人工智能为代表的科学技术发展的日益成熟，人类将面临着从进化到智人以来一次大改变，绝大部分人将沦为“无价值的群体”，只有少部分人能进化成特质发生改变的“神人”。未来，人类将面临着三大问题：生物本身就是算法，生命是不断处理数据的过程；意识与智能的分离；拥有大数据积累的外部环境将比我们自己更了解自己。如何看待这三大问题，以及如何采取应对措施，将直接影响着人类未来的发展。', 'http://resource.gbxx123.com/mindmap/2017/8/18/1503067989142/1503067989142.json', '5', '218', '2017-09-14 19:57:17', '2017-09-14 19:57:17', '999', '999');
INSERT INTO `t_discovery` VALUES ('336', '54564', '1', '分享', null, 'http://resource.gbxx123.com/site/image/courseware/2017/7/17/1500276472942.jpg', '习近平“夜找书店”的故事', '在福建，习近平先后在宁德、福州担任党委一把手多年，如何加强党的建设，是他始终关注的问题，也是着力探索的问题。其中，思想建设、班子建设、基层组织建设是他重要的抓手。', 'http://resource.gbxx123.com/book/epubs/2017/7/17/1500276366100/ops/chapter1.html', '7', '220', '2017-09-14 19:58:12', '2017-09-14 19:58:12', '999', '999');
