INSERT INTO `t_discovery` VALUES ('343', '54562', '1', '领袖风采', null, 'http://resource.gbxx123.com/site/default/imageone.jpg', '“铁杆球迷”邓小平', '邓小平对足球运动情有独钟，是个铁杆足球迷。早在20世纪20年代，初次走出国门的邓小平在法国勤工俭学时，就被足球比赛深深地吸引了。新中国成立后，邓小平对中国足球事业提出了许多富有建设性的建议。', 'http://resource.gbxx123.com/book/epubs/2017/9/11/1505110642394/ops/chapter1.html', '7', '232', '2017-09-14 20:21:10', '2017-09-14 20:21:10', '1000', '999');
