INSERT INTO `t_discovery` VALUES ('350', '54551', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/9/12/1505207306261.jpg', '天朝的崩溃：鸦片战争再研究', '《天朝的崩溃：鸦片战争再研究（修订本）》是茅海建系统研究鸦片战争历经十余年所得成果。　　茅海建详尽考订了与战争相关的一系列重要史实，力图以当时的道德观念、思维方式与行为规范去理解历史，使许多在今人看来是荒谬的现象得以显示其在当时环境中的“合理性”。同时，通过对有关人物及其言行活动分析，观察清王朝在历史转折关头的作为，揭示历史进程中的偶然与必然。鸦片战争在中国近代史上影响重大，有关著述已出版不少。《天朝的崩溃：鸦片战争再研究》的研究可谓推陈出新，茅海建一系列独到创见可能在学术界引起争议，相信这种争议将有助于深化中国近代史研究。　　《天朝的崩溃：鸦片战争再研究（修订本）》对我国鸦片战争这段历史作了回顾，试图以全新的视角来解析这场颠覆清王朝的浩劫。作为一名求真的治史者，茅海建历数了清朝的军事力量、骤然而至的战争、广州的“战局”、“抚”议再起等内容，从一个侧面反映了鸦片战争对于清朝统治打击的致命性，是一部不可多得的史学论著。', 'http://resource.gbxx123.com/index/studyPlatform/eb/2017/9/94936.xml', '6', '247', '2017-09-14 20:42:36', '2017-09-14 20:42:36', '1000', '999');
