INSERT INTO `t_discovery` VALUES ('354', '54563', '0', '　中共是中国特色社会主义的领导核心，坚持党的领导是指坚持中共在中国特色社会主义事业中的的领导核心地位。\n　　一、为什么要坚持党的领导？\n　　只有坚持中共的领导，才能始终保持现代化建设的社会主义方向；才能维护国家的统一、民族的团结，并为社会主义现代化建设创造稳定的明地名百度知道\n\n提问\n\n￼百度知道十分钟内有问必答立即下载\n\n如何理解坚持党的领导\n\n小凯PY14 2013-10-14\n\n专你的业回答', 'http://120.77.43.199:9090/upload/images/picture/1505473253779_1505473249391703.jpg,http://120.77.43.199:9090/upload/images/picture/1505473253780_1505473249681711.jpg,http://120.77.43.199:9090/upload/images/picture/1505473253780_1505473249938571.jpg,http://120.77.43.199:9090/upload/images/picture/1505473253780_1505473250201276.jpg,http://120.77.43.199:9090/upload/images/picture/1505473253780_1505473250468750.jpg,http://120.77.43.199:9090/upload/images/picture/1505473253780_150547325069948.jpg,http://120.77.43.199:9090/upload/images/picture/1505473253781_1505473250888511.jpg,http://120.77.43.199:9090/upload/images/picture/1505473253781_1505473251163288.jpg,http://120.77.43.199:9090/upload/images/picture/1505473253781_1505473251441853.jpg', null, null, null, null, null, null, '2017-09-15 19:00:53', '2017-09-15 19:00:53', '1001', '1003');
INSERT INTO `t_discovery` VALUES ('356', '54570', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/7/17/1500276472942.jpg', '习近平“夜找书店”的故事', '在福建，习近平先后在宁德、福州担任党委一把手多年，如何加强党的建设，是他始终关注的问题，也是着力探索的问题。其中，思想建设、班子建设、基层组织建设是他重要的抓手。', 'http://resource.gbxx123.com/book/epubs/2017/7/17/1500276366100/ops/chapter1.html', '7', '220', '2017-09-15 19:10:57', '2017-09-15 19:10:57', '2', '2');
INSERT INTO `t_discovery` VALUES ('357', '54563', '1', '我', null, 'http://resource.gbxx123.com/site/image/courseware/2017/9/12/1505194917281.jpg', '习近平致《联合国防治荒漠化公约》第十三次缔约方大会高级别会议的贺信', '值此《联合国防治荒漠化公约》第十三次缔约方大会高级别会议开幕之际，我谨代表中国政府和中国人民，向会议的召开致以热烈的祝贺！向出席会议的各国代表、国际机构负责人和各界人士致以诚挚的欢迎！', 'http://resource.gbxx123.com/book/epubs/2017/9/11/1505117403167/ops/chapter1.html', '7', '216', '2017-09-15 19:23:03', '2017-09-15 19:23:03', '2', '1');
INSERT INTO `t_discovery` VALUES ('360', '54563', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/7/3/1499071264200.jpg', '习近平离京对俄罗斯、德国进行国事访问并出席G20峰会', '国家主席习近平7月3日上午乘专机离开北京，应俄罗斯联邦总统普京、德意志联邦共和国总统施泰因迈尔和总理默克尔邀请，对俄罗斯和德国进行国事访问；应德意志联邦共和国总理默克尔邀请，出席在德国汉堡举行的二十国集团领导人第十二次峰会。', 'http://resource.gbxx123.com/book/epubs/2017/7/3/1499071070073/ops/chapter1.html', '7', '216', '2017-09-15 20:18:41', '2017-09-15 20:18:41', '1', '0');
INSERT INTO `t_discovery` VALUES ('361', '54563', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/9/4/1504509640464.jpg', '金砖国家领导人第九次会晤举行 习近平主持会晤并发表重要讲话 ', '金砖国家领导人第九次会晤9月4日在厦门国际会议中心举行。国家主席习近平主持会晤。南非总统祖马、巴西总统特梅尔、俄罗斯总统普京、印度总理莫迪出席。五国领导人围绕“深化金砖伙伴关系，开辟更加光明未来”的主题，就当前国际形势、全球经济治理、金砖合作、国际和地区热点问题等深入交换看法，回顾金砖合作10年历程，重申开放包容、合作共赢的金砖精神，达成一系列共识，为金砖合作未来发展规划了蓝图、指明了方向。', 'http://resource.gbxx123.com/book/epubs/2017/9/4/1504509397952/ops/chapter1.html', '7', '216', '2017-09-15 20:19:38', '2017-09-15 20:19:38', '3', '0');
INSERT INTO `t_discovery` VALUES ('362', '54563', '1', '', null, 'http://xxzlres.xxzg123.com/images/km/8.jpg', '雄关漫道：马克思主义中国化的历史进程及其理论成果', '本书紧紧围绕马克思主义与中国实际相结合的历史进程，以流畅生动的语言、大量详实的史实，深入系统地分析，从马克思主义传入中国的东方欲晓，到中国共产党人历经艰难困苦提出和探索马克思主义与中国实际相结合的苦难辉煌，从新中国成立后艰辛探索中国建设社会主义道路的风雨前行，到十一届三中全会以后我国全面进行改革开放的关键抉择，从中国特色社会主义道路的确立，到中华民族伟大复兴中国梦的实现，勾勒出了一条清晰的马克思主义中国化百年流变的雄关漫道。本书是一本集理论性、史料性和可读性于一体的阐述马克思主义中国化历史进程的理论读物。', 'http://resource.gbxx123.com/mindmap/2017/5/31/1496199063056/1496199063056.json', '5', '218', '2017-09-15 20:26:46', '2017-09-15 20:26:46', '2', '0');
INSERT INTO `t_discovery` VALUES ('363', '54563', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/7/17/1500276472942.jpg', '习近平“夜找书店”的故事', '在福建，习近平先后在宁德、福州担任党委一把手多年，如何加强党的建设，是他始终关注的问题，也是着力探索的问题。其中，思想建设、班子建设、基层组织建设是他重要的抓手。', 'http://resource.gbxx123.com/book/epubs/2017/7/17/1500276366100/ops/chapter1.html', '7', '220', '2017-09-15 20:36:58', '2017-09-15 20:36:58', '2', '0');
INSERT INTO `t_discovery` VALUES ('364', '54563', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/3/2/1488444572704.jpg', '有个群众给习近平写了一首词', '习近平在福州任市委书记时首推“马上就办”的工作作风，为整顿当时政府机关办事慵懒的风气起到了十分重要作用。', 'http://resource.gbxx123.com/book/epubs/2017/3/2/1488442371253/ops/chapter1.html', '7', '220', '2017-09-15 20:40:32', '2017-09-15 20:40:32', '2', '0');
