INSERT INTO `t_discovery` VALUES ('395', '54599', '0', '“得其大者可以兼其小”只有把人生理想融入国家和民族的事业中，才能最终成就一番事业。珍惜韶华、奋发有为，勇做走在时代前面的奋进者、开拓者、奉献者，努力使自己成为祖国建设的有用之才、栋梁之材，为实现中国梦奉献智慧和力量。', null, null, null, null, null, null, null, '2017-09-16 11:24:49', '2017-09-16 11:24:49', '3', '1');
INSERT INTO `t_discovery` VALUES ('396', '54600', '0', '“功崇惟志，业广惟勤”青年一定要坚定理想信念。理想指引人生方向，信念决定事业成败。没有理想信念，就会导致精神上“缺钙”。中国梦是全国各族人民的共同理想，也是青年一代应该牢固树立的远大理想。中国特色社会主义是我们党带领人民历经千辛万苦找到的实现中国梦的正确道路，也是广大青年应该牢固确立的人生信念。', null, null, null, null, null, null, null, '2017-09-16 11:25:49', '2017-09-16 11:25:49', '3', '1');
INSERT INTO `t_discovery` VALUES ('397', '54601', '0', '最美逆行！保卫祖国！保卫人民是我们的使命！', 'http://120.77.43.199:9090/upload/images/picture/1505532410361_1505532409911378.jpg,http://120.77.43.199:9090/upload/images/picture/1505532410362_1505532409933142.jpg,http://120.77.43.199:9090/upload/images/picture/1505532410362_1505532409978295.jpg', null, null, null, null, null, null, '2017-09-16 11:26:50', '2017-09-16 11:26:50', '3', '1');
INSERT INTO `t_discovery` VALUES ('398', '54601', '0', '“凿井者，起于三寸之坎，以就万仞之深”青年的价值取向决定了未来整个社会的价值取向，而青年又处在价值观形成和确立的时期，抓好这一时期的价值观养成十分重要。这就像穿衣服扣扣子一样，如果第一粒扣子扣错了，剩余的扣子都会扣错。人生的扣子从一开始就要扣好。青年要从现在做起、从自己做起，使社会主义核心价值观成为自己的基本遵循，并身体力行大力将其推广到全社会去。', null, null, null, null, null, null, null, '2017-09-16 11:28:17', '2017-09-16 11:28:17', '3', '0');
INSERT INTO `t_discovery` VALUES ('399', '54602', '0', '　“非学无以广才，非志无以成学”勤学，下得苦功夫，求得真学问。知识是树立核心价值观的重要基础。人生只有一次，应该好好珍惜。为学之要贵在勤奋、贵在钻研、贵在有恒。鲁迅先生说过：“哪里有天才，我是把别人喝咖啡的工夫都用在工作上的。”要勤于学习、敏于求知，注重把所学知识内化于心，形成自己的见解，既要专攻博览，又要关心国家、关心人民、关心世界，学会担当社会责任。', null, null, null, null, null, null, null, '2017-09-16 11:29:40', '2017-09-16 11:29:40', '2', '0');
