INSERT INTO `t_discovery` VALUES ('422', '54624', '1', '学习！', null, 'http://resource.gbxx123.com/site/image/courseware/2017/9/9/1504963795232.jpg', '全球金融治理格局', '全球金融治理是指主权国家、政府间金融监管机构和国际金融组织等组织机构为建立或维持理想国际金融秩序，通过多边或双边、正式或非正式的协调、合作、确立共识等方式管理全球金融事务的行为。全球金融治理格局即全球金融治理的局势、态势。2016年9月3日，习近平在二十国集团工商峰会开幕式上提出：二十国集团应共同构建公正高效的全球金融治理格局，维护世界经济稳定大局。', 'http://resource.gbxx123.com/book/epubs/2017/9/9/1504963587653/ops/chapter1.html', '7', '217', '2017-09-16 12:27:25', '2017-09-16 12:27:25', '4', '0');
