INSERT INTO `t_discovery` VALUES ('426', '54563', '0', '这个十八届四中全会决定中写得还是比较明白的，可以摘录如下。\n党的领导是中国特色社会主义最本质的特征，是社会主义法治最根本的保证。把党的领导贯彻到依法治国全过程和各方面，是我国社会主义法治建设的一条基本经验。我国宪法确立了中国共产党的领导地位。坚持党的领导，是社会主义法治的根本要求，是党和国家的根本所在、命脉所在，是全国各族人民的利益所系、幸福所系，是全面推进依法治国的题中应有之义。党的领导和社会主', null, null, null, null, null, null, null, '2017-09-16 20:29:28', '2017-09-16 20:29:28', '2', '0');
