INSERT INTO `t_discovery` VALUES ('429', '54563', '1', '', null, 'http://xxzlres.xxzg123.com/images/km/10.jpg', '习近平讲故事', '《习近平讲故事》一书，共收入109则故事，分为对内篇和对外篇。对内篇包括廉政、品格、励志、治理等；对外篇侧重于人民友好、国家交往、文化融通、历史情感等。每则故事在引用原文之外，还配有“延伸阅读”，用以丰富故事细节，还原故事语境，让读者更好地体悟故事背后的改革发展之道、大国外交之道、修身为人之道。', 'http://resource.gbxx123.com/mindmap/2017/8/23/1503453423302/1503453423302.json', '5', '218', '2017-09-16 20:45:13', '2017-09-16 20:45:13', '7', '0');
