INSERT INTO `t_discovery` VALUES ('431', '54563', '1', '', null, 'http://xxzlres.xxzg123.com/images/km/8.jpg', '雄关漫道：马克思主义中国化的历史进程及其理论成果', '本书紧紧围绕马克思主义与中国实际相结合的历史进程，以流畅生动的语言、大量详实的史实，深入系统地分析，从马克思主义传入中国的东方欲晓，到中国共产党人历经艰难困苦提出和探索马克思主义与中国实际相结合的苦难辉煌，从新中国成立后艰辛探索中国建设社会主义道路的风雨前行，到十一届三中全会以后我国全面进行改革开放的关键抉择，从中国特色社会主义道路的确立，到中华民族伟大复兴中国梦的实现，勾勒出了一条清晰的马克思主义中国化百年流变的雄关漫道。本书是一本集理论性、史料性和可读性于一体的阐述马克思主义中国化历史进程的理论读物。', 'http://resource.gbxx123.com/mindmap/2017/5/31/1496199063056/1496199063056.json', '5', '218', '2017-09-16 20:47:09', '2017-09-16 20:47:09', '6', '0');
