INSERT INTO `t_discovery` VALUES ('434', '54563', '0', '小炮兵', 'http://120.77.43.199:9090/upload/images/picture/1505567756716_150556775353016.jpg,http://120.77.43.199:9090/upload/images/picture/1505567756716_150556775377616.jpg,http://120.77.43.199:9090/upload/images/picture/1505567756716_1505567753996708.jpg,http://120.77.43.199:9090/upload/images/picture/1505567756718_150556775420357.jpg,http://120.77.43.199:9090/upload/images/picture/1505567756718_1505567754544628.jpg,http://120.77.43.199:9090/upload/images/picture/1505567756719_1505567754860454.jpg,http://120.77.43.199:9090/upload/images/picture/1505567756719_1505567755093362.jpg,http://120.77.43.199:9090/upload/images/picture/1505567756719_1505567755347608.jpg,http://120.77.43.199:9090/upload/images/picture/1505567756719_1505567755639890.jpg', null, null, null, null, null, null, '2017-09-16 21:15:56', '2017-09-16 21:15:56', '7', '2');
INSERT INTO `t_discovery` VALUES ('436', '54555', '1', 'nice', null, 'http://resource.gbxx123.com/site/image/courseware/2017/9/13/1505288628332.jpg', '时间地图：大历史,130亿年前至今', '如果把130亿年比喻成13年的话，那么宇宙大爆炸就发生在13年前，太阳系出现在4.5年前，*早的生命有机体出现在4年前，恐龙大约在3个星期前灭绝，*早的智人在非洲进化大约在50分钟以前，农业繁荣大约在5分钟以前，工业革命发生在大约6秒钟以前，第一次世界大战发生在大约2秒钟以前，此后，第二次世界大战，首次使用原子武器，人类登月，电子革命……都只不过是*后1秒钟的事。　　更换了时间尺度，人类的存在还有什么意义？《时间地图》打通时间线，将人类的历史置于生物圈甚至整个宇宙的历史之中，讲述从宇宙大爆炸至今，宇宙、地球、生命、人类的“大历史”（BigHistory）。　　大历史是一种新的尝试，在一个学术和知识日益碎片化的时代，打破学科界限，综合生物学、考古学、物理学、历史学等多学科，为今天的读者提供统合性的新知识。　　《时间地图》是大历史的开创之作，荣获美国世界史协会2004年度*佳图书奖。全球史奠基人威廉·麦克尼尔将本书与牛顿、达尔文的成就相提并论，《美国科学家》杂志称它“开创了一种令人眼前一亮的新史观”，比尔·盖茨则称它“改变了我们看世界的方式”。　　《时间地图》提供了一种新的世界观，更新了我们对历史和现实的认知。', 'http://resource.gbxx123.com/index/studyPlatform/eb/2017/9/94982.xml', '6', '247', '2017-09-16 21:48:15', '2017-09-16 21:48:15', '5', '0');
