INSERT INTO `t_discovery` VALUES ('438', '54563', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/9/5/1504592567382.jpg', '全球贸易和投资治理格局', '贸易和投资是全球经济增长的两大引擎，如何让这两大引擎转动得更加强劲，关系到全球经济治理的长远成效。当前，经济全球化出现波折，保护主义、内顾倾向抬头，多边贸易体制受到冲击。在这样的大背景下，2016年9月3日，习近平在二十国集团工商峰会开幕式上首次倡议要“共同构建开放透明的全球贸易和投资治理格局，巩固多边贸易体制，释放全球经贸投资合作潜力”。习近平的这一倡议既着眼当前又放眼长远，为重振全球贸易和投资引擎、指引世界经济走出低谷提供了中国智慧。', 'http://resource.gbxx123.com/book/epubs/2017/9/5/1504592399121/ops/chapter1.html', '7', '217', '2017-09-16 21:54:03', '2017-09-16 21:54:03', '5', '0');
INSERT INTO `t_discovery` VALUES ('439', '54563', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/9/1/1504237477871.jpg', ' 文化自信', '文化自信是一个民族、一个国家、一个政党和民众对自身文化价值的充分肯定和积极践行，并对其文化的生命力持有的坚定信心。2016年5月17日，习近平主持召开哲学社会科学工作座谈会时指出，文化自信是更基本、更深沉、更持久的力量。2016年6月28日，习近平主持中共中央政治局第33次集体学习时，首次把坚持中国特色文化自信，道路自信，理论自信，制度自信并驾齐驱。', 'http://resource.gbxx123.com/book/epubs/2017/9/1/1504237316431/ops/chapter1.html', '7', '217', '2017-09-16 21:58:25', '2017-09-16 21:58:25', '5', '0');
INSERT INTO `t_discovery` VALUES ('440', '54563', '1', '', null, 'http://xxzlres.xxzg123.com/images/km/10.jpg', '习近平讲故事', '《习近平讲故事》一书，共收入109则故事，分为对内篇和对外篇。对内篇包括廉政、品格、励志、治理等；对外篇侧重于人民友好、国家交往、文化融通、历史情感等。每则故事在引用原文之外，还配有“延伸阅读”，用以丰富故事细节，还原故事语境，让读者更好地体悟故事背后的改革发展之道、大国外交之道、修身为人之道。', 'http://resource.gbxx123.com/mindmap/2017/8/23/1503453423302/1503453423302.json', '5', '218', '2017-09-16 21:58:47', '2017-09-16 21:58:47', '5', '0');
INSERT INTO `t_discovery` VALUES ('441', '54563', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/7/17/1500276472942.jpg', '习近平“夜找书店”的故事', '在福建，习近平先后在宁德、福州担任党委一把手多年，如何加强党的建设，是他始终关注的问题，也是着力探索的问题。其中，思想建设、班子建设、基层组织建设是他重要的抓手。', 'http://resource.gbxx123.com/book/epubs/2017/7/17/1500276366100/ops/chapter1.html', '7', '220', '2017-09-16 22:03:16', '2017-09-16 22:03:16', '5', '0');
