INSERT INTO `t_discovery` VALUES ('448', '54563', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/8/30/1504074603800.jpg', '学历继续教育改革，英雄何必问出处——《舆情播报》第208期', '2016年11月，教育部发文规定，自2018年起，普通高等学校将不再举办本校全日制教育专业范围外的学历继续教育，没有举办全日制专科层次教育的普通本科高校，不再举办专科层次的学历继续教育。当下正值成人高考和自学考试的报考咨询季，赶“末班车”去拿名校专科学历的报名人数陡增。同时，全国各重点大学继续教育学院的招考政策日趋收紧，多地多所大学的学历继续教育已经停办。', 'http://resource.gbxx123.com/index/studyPlatform/mvf/2017/8/94219.xml', '9', '226', '2017-09-16 22:23:29', '2017-09-16 22:23:29', '6', '0');
INSERT INTO `t_discovery` VALUES ('449', '54554', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/9/12/1505194917281.jpg', '习近平致《联合国防治荒漠化公约》第十三次缔约方大会高级别会议的贺信', '值此《联合国防治荒漠化公约》第十三次缔约方大会高级别会议开幕之际，我谨代表中国政府和中国人民，向会议的召开致以热烈的祝贺！向出席会议的各国代表、国际机构负责人和各界人士致以诚挚的欢迎！', 'http://resource.gbxx123.com/book/epubs/2017/9/11/1505117403167/ops/chapter1.html', '7', '216', '2017-09-16 22:34:01', '2017-09-16 22:34:01', '7', '0');
INSERT INTO `t_discovery` VALUES ('450', '54554', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/6/29/1498722763691.jpg', '和平发展道路', '和平发展道路是指既通过维护世界和平发展自己，又通过自身发展维护世界和平。依靠自身力量和改革创新实现发展，同时坚持实行对外开放，顺应经济全球化发展潮流，寻求与各国互利共赢和共同发展，同国际社会一道努力，推动建设持久和平、共同繁荣的和谐世界。和平发展道路是中国社会发展的国际战略。2005年年底，中国政府发表《中国的和平发展道路》白皮书，阐述了中国走和平发展道路的立场和决心。2013年1月28日，习近平在主持中共中央政治局第三次集体学习时强调，“中国走和平发展道路，其他国家也都要走和平发展道路，只有各国都走和平发展道路，各国才能共同发展，国与国才能和平相处”。', 'http://resource.gbxx123.com/book/epubs/2017/6/29/1498721099009/ops/chapter1.html', '7', '217', '2017-09-16 22:36:02', '2017-09-16 22:36:02', '9', '3');
