INSERT INTO `t_discovery` VALUES ('456', '54661', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/9/9/1504963795232.jpg', '全球金融治理格局', '全球金融治理是指主权国家、政府间金融监管机构和国际金融组织等组织机构为建立或维持理想国际金融秩序，通过多边或双边、正式或非正式的协调、合作、确立共识等方式管理全球金融事务的行为。全球金融治理格局即全球金融治理的局势、态势。2016年9月3日，习近平在二十国集团工商峰会开幕式上提出：二十国集团应共同构建公正高效的全球金融治理格局，维护世界经济稳定大局。', 'http://resource.gbxx123.com/book/epubs/2017/9/9/1504963587653/ops/chapter1.html', '7', '217', '2017-09-27 16:08:52', '2017-09-27 16:08:52', '8', '0');
INSERT INTO `t_discovery` VALUES ('457', '54661', '1', '', null, 'http://xxzlres.xxzg123.com/images/km/8.jpg', '雄关漫道：马克思主义中国化的历史进程及其理论成果', '本书紧紧围绕马克思主义与中国实际相结合的历史进程，以流畅生动的语言、大量详实的史实，深入系统地分析，从马克思主义传入中国的东方欲晓，到中国共产党人历经艰难困苦提出和探索马克思主义与中国实际相结合的苦难辉煌，从新中国成立后艰辛探索中国建设社会主义道路的风雨前行，到十一届三中全会以后我国全面进行改革开放的关键抉择，从中国特色社会主义道路的确立，到中华民族伟大复兴中国梦的实现，勾勒出了一条清晰的马克思主义中国化百年流变的雄关漫道。本书是一本集理论性、史料性和可读性于一体的阐述马克思主义中国化历史进程的理论读物。', 'http://resource.gbxx123.com/mindmap/2017/5/31/1496199063056/1496199063056.json', '5', '218', '2017-09-27 16:23:20', '2017-09-27 16:23:20', '12', '2');
