INSERT INTO `t_discovery` VALUES ('461', '54576', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/9/30/1506742256117.jpg', '习近平：继续推进马克思主义中国化时代化大众化 ', '中共中央政治局9月29日下午就当代世界马克思主义思潮及其影响进行第四十三次集体学习。中共中央总书记习近平在主持学习时强调，我们党是用马克思主义武装起来的政党，马克思主义是我们共产党人理想信念的灵魂。', 'http://resource.gbxx123.com/book/epubs/2017/9/30/1507860176552/ops/chapter1.html', '11', '216', '2017-10-19 17:20:22', '2017-10-19 17:20:22', '7', '0');
