INSERT INTO `t_discovery` VALUES ('467', '54818', '1', '', null, 'http://xxzlres.xxzg123.com/images/km/4.jpg', '【喜迎十九大】怎样炼成好干部', '作者围绕“怎样才是好干部”这个主题，阐述了党员干部要按照习总书记提出的“好干部”标准，坚持信念坚定，做到坚持理想、坚守信仰、坚定自信；坚持为民服务，做到情为民系、权为民用、利为民谋；坚持勤政务实，做到勤勉尽职、求真务实、真抓实干；坚持敢于担当，做到敢闯敢试、敢作敢为、敢作敢当；坚持清正廉洁，做到清白清廉、清正清明、清贫清风。　　作者围绕“怎样成为好干部”这个主题，阐述了成为新时期的好干部既要靠自己内修外练，坚持严以修身、严以律己、严以用权，做到善学善思、善说善做、善写善算；又要靠组织培养管教，做到严格教育、严格管理、严格监督、严格要求。　　作者围绕“怎样选用好干部”这个主题，阐述了选用新时期的好干部要坚持德才兼备，做到注重道德、注重人格、注重能力；坚持任人唯贤，做到选贤任能、考评实绩、知人善任、能上能下，真正把好干部选出来、用起来，营造用一贤人则群贤毕至的风尚，形成见贤思齐就蔚然成风的氛围。　　作者围绕“好干部怎样干好事”这个主题，阐述了新时期的好干部要坚持谋事要实，做到符合实际、符合规律、符合科学；坚持创业要实，做到善于创新、善抓落实、善干实事；坚持、做人要实，做到忠诚老实、善作善为、善始善终、善作善成。', 'http://resource.gbxx123.com/mindmap/2017/10/8/1507428864143/1507428864143.json', '5', '218', '2017-11-12 21:51:00', '2017-11-12 21:51:00', '11', '0');
INSERT INTO `t_discovery` VALUES ('468', '54818', '1', '年轻人就该闯一闯', null, 'http://resource.gbxx123.com/site/image/courseware/2017/2/20/1487589762846.jpg', '习近平教你“闯”', '“路见不平一声吼哇!该出手时就出手哇!风风火火闯九州哇!”1998年刘欢的一首《好汉歌》以激昂的曲调红遍大江南北，唱出了数万人民群众的内心深处的“闯”。', 'http://resource.gbxx123.com/book/epubs/2017/2/20/1487589109566/ops/chapter1.html', '7', '220', '2017-11-12 21:53:46', '2017-11-12 21:53:46', '11', '0');
