INSERT INTO `t_discovery` VALUES ('470', '54574', '1', '在党的正确领导下，生活条件有了很大改善。', null, 'http://resource.gbxx123.com/site/image/courseware/2017/11/27/1511762660845.jpg', '习近平：坚持不懈推进“厕所革命” 努力补齐影响群众生活品质短板', '中共中央总书记、国家主席、中央军委主席习近平近日就旅游系统推进“厕所革命”工作取得的成效作出重要指示。', 'http://resource.gbxx123.com/book/epubs/2017/11/27/1511762470806/ops/chapter1.html', '7', '216', '2017-11-28 10:48:16', '2017-11-28 10:48:16', '11', '0');
INSERT INTO `t_discovery` VALUES ('471', '54574', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/10/10/1507618821008.jpg', '红色基因', '红色基因是我们党在长期奋斗中淬炼的先进本质、思想路线、光荣传统和优良作风的总称。红色基因诞生于南湖船头，以为人民利益不懈奋斗为己任；它形成于艰苦卓绝的革命战争年代，培育了伟大的井冈山精神、长征精神、延安精神、西北坡精神；它发展于激情燃烧的建设改革时期，孕育了“两弹一星”精神、雷锋精神、焦裕禄精神、抗震救灾精神、载人航天精神等。', 'http://resource.gbxx123.com/book/epubs/2017/10/10/1507618780037/ops/chapter1.html', '7', '217', '2017-11-28 11:00:48', '2017-11-28 11:00:48', '12', '0');
INSERT INTO `t_discovery` VALUES ('472', '54574', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/8/16/1502867802505.jpg', '军事训练实战化', '实战化训练，是和平时期提高部队作战能力的基本军事实践活动，具有对抗性、应用性、综合性和风险性等特征，其标准更高、组织更难。战斗力生成没有捷径，只能从平时训练抓起。', 'http://resource.gbxx123.com/book/epubs/2017/8/16/1502867727459/ops/chapter1.html', '7', '217', '2017-11-28 11:01:28', '2017-11-28 11:01:28', '13', '0');
INSERT INTO `t_discovery` VALUES ('473', '54574', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/9/27/1506495948990.jpg', '  开弓没有回头箭', '开弓没有回头箭，箭已开弓射出就无法再收回，比喻事情既然已经开始，就要勇往直前，决不后退。十八大以来，习近平多次提到“开弓没有回头箭”，要坚定不移地把改革事业推向深入，要坚定不移地把反腐斗争进行到底，彰显出打好改革与反腐攻坚战的坚定信心与决心。', 'http://resource.gbxx123.com/book/epubs/2017/9/27/1506495937408/ops/chapter1.html', '7', '217', '2017-11-28 11:02:35', '2017-11-28 11:02:35', '13', '0');
INSERT INTO `t_discovery` VALUES ('474', '54970', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/8/16/1502867802505.jpg', '军事训练实战化', '实战化训练，是和平时期提高部队作战能力的基本军事实践活动，具有对抗性、应用性、综合性和风险性等特征，其标准更高、组织更难。战斗力生成没有捷径，只能从平时训练抓起。', 'http://resource.gbxx123.com/book/epubs/2017/8/16/1502867727459/ops/chapter1.html', '7', '217', '2017-11-28 11:03:54', '2017-11-28 11:03:54', '14', '1');
INSERT INTO `t_discovery` VALUES ('475', '54970', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/5/12/1494576356334.jpg', '不忘初心', '“不忘初心”出自佛经《华严经》，原文“不忘初心，方得始终。”本意是说，潜心修学者，在修学过程中，只有不忘记自己的本初之心，才能持之以恒，坚持不懈，善始善终。习近平总书记在庆祝中国共产党成立95周年大会的讲话中，引申为“不忘初心、继续前进”，告诫全党同志“不忘初心”，号召全党同志“继续前进”。', 'http://resource.gbxx123.com/book/epubs/2017/5/12/1494575899708/ops/chapter1.html', '7', '217', '2017-11-28 11:04:06', '2017-11-28 11:04:06', '13', '0');
INSERT INTO `t_discovery` VALUES ('476', '54970', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/11/27/1511752603868.jpg', ' 全面依法治国', '法律是治国之重器，法治是治国理政的基本方式。党的十八大以来，以习近平同志为总书记的党中央高度重视全面依法治国。党的十八届四中全会作出关于全面推进依法治国的决定，强调这是全面建成小康社会的迫切需要，也是全面深化改革、全面从严治党的迫切需要。', 'http://resource.gbxx123.com/book/epubs/2017/11/27/1511752526527/ops/chapter1.html', '7', '217', '2017-11-28 11:04:54', '2017-11-28 11:04:54', '14', '0');
INSERT INTO `t_discovery` VALUES ('477', '54970', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/11/3/1509689709109.jpg', '美丽中国', '“美丽中国”是中国共产党第十八次全国代表大会提出的概念，是指山美、水美、人美，环境美、生活美、一切美，其实质是要求人类与自然和谐相处，尊重自然、顺应自然、保护自然，把生态文明建设放在突出地位，融入经济建设、政治建设、文化建设、社会建设各方面和全过程。', 'http://resource.gbxx123.com/book/epubs/2017/11/3/1509689660569/ops/chapter1.html', '7', '217', '2017-11-28 11:05:03', '2017-11-28 11:05:03', '19', '1');
INSERT INTO `t_discovery` VALUES ('478', '54552', '1', '时代军人应有的抱负', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/7/1512616685352.jpg', ' 功成不必在我', '功成不必在我，亦可为功不必在我，是指功绩、事情、事业的成功，没有必要看我一个人。可以理解这件事不是非我不可，也可以理解为一件事情的成功的必然因素不在于我，体现了一种宽广大度和高尚情怀。', 'http://resource.gbxx123.com/book/epubs/2017/12/7/1512616462057/ops/chapter1.html', '7', '217', '2017-12-08 16:17:07', '2017-12-08 16:17:07', '11', '0');
