INSERT INTO `t_discovery` VALUES ('492', '55416', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/28/1514422552960.jpg', '中共中央政治局召开会议 决定召开十九届二中全会', '中共中央政治局12月27日召开会议，决定明年1月在北京召开中国共产党第十九届中央委员会第二次全体会议，主要议程是，讨论研究修改宪法部分内容的建议。', 'http://resource.gbxx123.com/book/epubs/2017/12/28/1514422383212/ops/chapter1.html', '7', '216', '2017-12-29 19:25:23', '2017-12-29 19:25:23', '8', '0');
INSERT INTO `t_discovery` VALUES ('493', '55416', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/7/17/1500276472942.jpg', '习近平“夜找书店”的故事', '在福建，习近平先后在宁德、福州担任党委一把手多年，如何加强党的建设，是他始终关注的问题，也是着力探索的问题。其中，思想建设、班子建设、基层组织建设是他重要的抓手。', 'http://resource.gbxx123.com/book/epubs/2017/7/17/1500276366100/ops/chapter1.html', '7', '220', '2017-12-30 10:49:35', '2017-12-30 10:49:35', '8', '0');
INSERT INTO `t_discovery` VALUES ('494', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/10/31/1509438914592.jpg', '向习近平学“用人之道”', '从隋灭的前车之鉴与唐兴的为政经验中，唐太宗总结得出：“为政之要，惟在得人。”《资治通鉴》对为政用人问题亦主张：“为治之要，莫先于用人。”纵览古今中外国运之兴衰，无不与“用人”有着密切联系。由此可见，政以才治，国以人兴，千秋大业，贵在用人。习近平总书记对“用人”的重视由来已久，十八大以来，习近平总书记更是就干部选任问题发表了大量重要论述。今天，“学习大军”就和大家一同去学学习近平总书记的“用人之道”。', 'http://resource.gbxx123.com/book/epubs/2017/10/31/1509438439387/ops/chapter1.html', '7', '220', '2017-12-30 22:11:59', '2017-12-30 22:11:59', '9', '0');
