INSERT INTO `t_discovery` VALUES ('497', '54838', '1', '红色经典', null, 'http://xxzlres.xxzg123.com/images/ueditor/image/20170913/1505300715409075663.jpg', '血战台儿庄', '《血战台儿庄》（BattleofTaierzhuang）是由杨光远和翟俊杰联合导演，邵宏来，初国良、江化霖、赵恒多、翟俊杰等主演战争电影。\r\n该片讲述了1938年春，国民革命军在台儿庄与日军正面对战，最终告捷的历史。', 'http://xxzlres.xxzg123.com/index/vf/2017/9/13/150530074401223517.xml', '3', '237', '2018-01-01 21:37:41', '2018-01-01 21:37:41', '11', '0');
INSERT INTO `t_discovery` VALUES ('498', '54838', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/1/1514779706637.jpg', '国家主席习近平发表二〇一八年新年贺词 ', '新年前夕，国家主席习近平通过中国国际广播电台、中央人民广播电台、中央电视台、中国国际电视台（中国环球电视网）和互联网，发表了二〇一八年新年贺词。', 'http://resource.gbxx123.com/book/epubs/2018/1/1/1514779387354/ops/chapter1.html', '7', '216', '2018-01-01 21:39:01', '2018-01-01 21:39:01', '11', '0');
INSERT INTO `t_discovery` VALUES ('499', '55044', '1', '', null, '', '深入学习十九大精神立足本职岗位当好改革强军的实践者', '深入学习十九大精神立足本职岗位当好改革强军的实践者', 'http://xxzlres.xxzg123.com/article/wa/zy/2017/12/3/151229189340326255.html', '7', '228', '2018-01-02 08:34:03', '2018-01-02 08:34:03', '13', '0');
INSERT INTO `t_discovery` VALUES ('500', '55052', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/7/17/1500276472942.jpg', '习近平“夜找书店”的故事', '在福建，习近平先后在宁德、福州担任党委一把手多年，如何加强党的建设，是他始终关注的问题，也是着力探索的问题。其中，思想建设、班子建设、基层组织建设是他重要的抓手。', 'http://resource.gbxx123.com/book/epubs/2017/7/17/1500276366100/ops/chapter1.html', '7', '220', '2018-01-02 20:11:19', '2018-01-02 20:11:19', '7', '0');
INSERT INTO `t_discovery` VALUES ('501', '55052', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/3/2/1488444572704.jpg', '有个群众给习近平写了一首词', '习近平在福州任市委书记时首推“马上就办”的工作作风，为整顿当时政府机关办事慵懒的风气起到了十分重要作用。', 'http://resource.gbxx123.com/book/epubs/2017/3/2/1488442371253/ops/chapter1.html', '7', '220', '2018-01-02 20:11:40', '2018-01-02 20:11:40', '8', '1');
INSERT INTO `t_discovery` VALUES ('502', '55049', '1', '真的可以哦', null, 'http://resource.gbxx123.com/site/default/imageone.jpg', '抗战时期的福建省立医学院师生', '抗战时期的福建省立医学院师生', 'http://resource.gbxx123.com/book/epubs/2017/12/29/1514530441039/ops/chapter1.html', '7', '236', '2018-01-02 20:31:07', '2018-01-02 20:31:07', '7', '0');
INSERT INTO `t_discovery` VALUES ('503', '55049', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/10/31/1509438914592.jpg', '向习近平学“用人之道”', '从隋灭的前车之鉴与唐兴的为政经验中，唐太宗总结得出：“为政之要，惟在得人。”《资治通鉴》对为政用人问题亦主张：“为治之要，莫先于用人。”纵览古今中外国运之兴衰，无不与“用人”有着密切联系。由此可见，政以才治，国以人兴，千秋大业，贵在用人。习近平总书记对“用人”的重视由来已久，十八大以来，习近平总书记更是就干部选任问题发表了大量重要论述。今天，“学习大军”就和大家一同去学学习近平总书记的“用人之道”。', 'http://resource.gbxx123.com/book/epubs/2017/10/31/1509438439387/ops/chapter1.html', '7', '220', '2018-01-02 20:31:28', '2018-01-02 20:31:28', '15', '0');
