INSERT INTO `t_discovery` VALUES ('506', '55043', '1', '造就一支懂农业、爱农村、爱农民的农村工作队伍。', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/29/1514552341435.jpg', '中央农村工作会议在北京举行 习近平作重要讲话 ', '中央农村工作会议12月28日至29日在北京举行。会议深入贯彻党的十九大精神、习近平新时代中国特色社会主义思想，全面分析“三农”工作面临的形势和任务，研究实施乡村振兴战略的重要政策，部署2018年和今后一个时期的农业农村工作。', 'http://resource.gbxx123.com/book/epubs/2017/12/29/1514550854245/ops/chapter1.html', '7', '216', '2018-01-02 22:32:13', '2018-01-02 22:32:13', '6', '0');
