INSERT INTO `t_discovery` VALUES ('514', '55044', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/8/16/1502867802505.jpg', '军事训练实战化', '实战化训练，是和平时期提高部队作战能力的基本军事实践活动，具有对抗性、应用性、综合性和风险性等特征，其标准更高、组织更难。战斗力生成没有捷径，只能从平时训练抓起。', 'http://resource.gbxx123.com/book/epubs/2017/8/16/1502867727459/ops/chapter1.html', '7', '217', '2018-01-04 12:43:33', '2018-01-04 12:43:33', '5', '0');
INSERT INTO `t_discovery` VALUES ('515', '55044', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/5/12/1494576356334.jpg', '不忘初心', '“不忘初心”出自佛经《华严经》，原文“不忘初心，方得始终。”本意是说，潜心修学者，在修学过程中，只有不忘记自己的本初之心，才能持之以恒，坚持不懈，善始善终。习近平总书记在庆祝中国共产党成立95周年大会的讲话中，引申为“不忘初心、继续前进”，告诫全党同志“不忘初心”，号召全党同志“继续前进”。', 'http://resource.gbxx123.com/book/epubs/2017/5/12/1494575899708/ops/chapter1.html', '7', '217', '2018-01-04 12:44:49', '2018-01-04 12:44:49', '5', '0');
INSERT INTO `t_discovery` VALUES ('516', '55044', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/4/14/1492151994045.jpg', ' 人类命运共同体', '2012年党的十八大报告正式提出“倡导人类命运共同体意识”，此后，习近平多个场合论述，“人类命运共同体”的概念越来越为人熟知，并走向世界。人类命运共同体理论集中反映了党的十八大以来习近平总书记的外交思想，它既是中国当代外交政策和习近平外交思想的精髓，也是中国特色大国外交最鲜明的特征。', 'http://resource.gbxx123.com/book/epubs/2017/4/14/1492150884739/ops/chapter1.html', '7', '217', '2018-01-04 12:45:30', '2018-01-04 12:45:30', '5', '0');
