INSERT INTO `t_discovery` VALUES ('519', '55038', '1', '啊', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/22/1513906352719.jpg', '习近平同冈比亚总统巴罗举行会谈', '国家主席习近平12月21日在人民大会堂同来华进行国事访问的冈比亚总统巴罗举行会谈。两国元首一致同意，共同规划好中冈合作新蓝图，推动双边关系持续深入发展。', 'http://resource.gbxx123.com/book/epubs/2017/12/22/1514364495477/ops/chapter1.html', '11', '216', '2018-01-04 16:39:17', '2018-01-04 16:39:17', '4', '0');
INSERT INTO `t_discovery` VALUES ('520', '55038', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/12/1513065024589.jpg', '习近平致中国农学会成立100周年的贺信', '值此中国农学会成立100周年之际，我向中国农学会全体同志、向广大农业科技工作者致以热烈的祝贺和诚挚的问候！', 'http://resource.gbxx123.com/book/epubs/2017/12/12/1514363750509/ops/chapter1.html', '11', '216', '2018-01-04 16:39:40', '2018-01-04 16:39:40', '4', '0');
INSERT INTO `t_discovery` VALUES ('521', '55038', '1', '啊', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/11/1512978763751.jpg', '习近平近日作出重要指示强调：纠正“四风”不能止步 作风建设永远在路上', '中共中央总书记、国家主席、中央军委主席习近平近日作出重要指示强调，纠正“四风”不能止步，作风建设永远在路上。', 'http://resource.gbxx123.com/book/epubs/2017/12/11/1513327365137/ops/chapter1.html', '11', '216', '2018-01-04 16:39:46', '2018-01-04 16:39:46', '4', '0');
INSERT INTO `t_discovery` VALUES ('522', '55038', '1', '啊', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/9/1512822877072.jpg', '习近平：实施国家大数据战略加快建设数字中国 ', '中共中央政治局12月8日下午就实施国家大数据战略进行第二次集体学习。中共中央总书记习近平在主持学习时强调，大数据发展日新月异，我们应该审时度势、精心谋划、超前布局、力争主动，深入了解大数据发展现状和趋势及其对经济社会发展的影响，分析我国大数据发展取得的成绩和存在的问题，推动实施国家大数据战略，加快完善数字基础设施，推进数据资源整合和开放共享，保障数据安全，加快建设数字中国，更好服务我国经济社会发展和人民生活改善。', 'http://resource.gbxx123.com/book/epubs/2017/12/9/1513327762648/ops/chapter1.html', '11', '216', '2018-01-04 16:39:52', '2018-01-04 16:39:52', '3', '0');
INSERT INTO `t_discovery` VALUES ('523', '55038', '1', '啊', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/7/1512637647003.jpg', '习近平致信祝贺首届“南南人权论坛”开幕强调：以合作促发展 以发展促人权 不断提高人权保障水平', '12月7日，首届“南南人权论坛”在京开幕。国家主席习近平发来贺信，对论坛的举办表示热烈的祝贺，强调全球人权事业发展离不开广大发展中国家共同努力，希望国际社会本着公正、公平、开放、包容的精神，尊重并反映发展中国家人民的意愿，促进发展中国家人民享有更加充分的人权，实现全人类共同繁荣发展。', 'http://resource.gbxx123.com/book/epubs/2017/12/7/1513750250029/ops/chapter1.html', '11', '216', '2018-01-04 16:40:01', '2018-01-04 16:40:01', '5', '0');
