INSERT INTO `t_discovery` VALUES ('527', '55038', '1', '啊', null, 'http://resource.gbxx123.com/site/image/courseware/2017/11/30/1512015930543.jpg', '习近平向2013－2022年亚太残疾人十年中期审查高级别政府间会议致贺信', '11月27日至12月1日，2013－2022年亚太残疾人十年中期审查高级别政府间会议在北京举行。国家主席习近平发来贺信，向会议的召开表示热烈祝贺。', 'http://resource.gbxx123.com/book/epubs/2017/11/30/1512636976613/ops/chapter1.html', '11', '216', '2018-01-04 16:40:28', '2018-01-04 16:40:28', '3', '0');
INSERT INTO `t_discovery` VALUES ('528', '55038', '1', '啊', null, 'http://resource.gbxx123.com/site/image/courseware/2017/11/30/1512015885844.jpg', '习近平应约同美国总统特朗普通电话', '国家主席习近平11月29日应约同美国总统特朗普通电话。', 'http://resource.gbxx123.com/book/epubs/2017/11/30/1512633175013/ops/chapter1.html', '11', '216', '2018-01-04 16:40:34', '2018-01-04 16:40:34', '3', '0');
INSERT INTO `t_discovery` VALUES ('529', '55038', '1', '啊', null, 'http://resource.gbxx123.com/site/image/courseware/2017/11/27/1511746482288.jpg', '习近平就埃及发生严重恐怖袭击向埃及总统塞西致慰问电', '国家主席习近平11月25日向埃及总统塞西致慰问电，就11月24日埃及北西奈省阿里什市一清真寺发生严重恐怖袭击向无辜遇难者表示沉痛哀悼，向塞西总统、遇难者家属和受伤人员致以诚挚的慰问。', 'http://resource.gbxx123.com/book/epubs/2017/11/27/1512721310413/ops/chapter1.html', '11', '216', '2018-01-04 16:40:42', '2018-01-04 16:40:42', '4', '0');
INSERT INTO `t_discovery` VALUES ('530', '55038', '1', '啊', null, 'http://resource.gbxx123.com/site/image/courseware/2017/11/23/1511442069075.jpg', '习近平同吉布提总统盖莱举行会谈', '国家主席习近平11月23日在人民大会堂同来华进行国事访问的吉布提总统盖莱举行会谈。两国元首一致同意，建立中吉战略伙伴关系，全面深化两国各领域合作。', 'http://resource.gbxx123.com/book/epubs/2017/11/23/1511441960767/ops/chapter1.html', '7', '216', '2018-01-04 16:40:47', '2018-01-04 16:40:47', '4', '0');
INSERT INTO `t_discovery` VALUES ('531', '55038', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/11/21/1511256381817.jpg', '习近平致首届丝绸之路沿线民间组织合作网络论坛贺信（全文）', '首届丝绸之路沿线民间组织合作网络论坛21日在北京召开。国家主席习近平向论坛致信祝贺。', 'http://resource.gbxx123.com/book/epubs/2017/11/21/1511426965807/ops/chapter1.html', '11', '216', '2018-01-04 16:40:55', '2018-01-04 16:40:55', '4', '0');
INSERT INTO `t_discovery` VALUES ('532', '55038', '1', '啊', null, 'http://resource.gbxx123.com/site/image/courseware/2017/11/22/1511311862553.jpg', '习近平回信勉励乌兰牧骑队员:永远做草原上的', '中共中央总书记、国家主席、中央军委主席习近平11月21日给内蒙古自治区苏尼特右旗乌兰牧骑的队员们回信，勉励他们继续扎根基层、服务群众，努力创作更多接地气、传得开、留得下的优秀作品。', 'http://resource.gbxx123.com/book/epubs/2017/11/22/1511426828515/ops/chapter1.html', '11', '216', '2018-01-04 16:41:03', '2018-01-04 16:41:03', '4', '0');
INSERT INTO `t_discovery` VALUES ('533', '55038', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/11/20/1511139848723.jpg', '习近平会见全国精神文明建设表彰大会代表 王沪宁参加会见并在表彰大会上讲话', '全国精神文明建设表彰大会11月17日在京举行。中共中央总书记、国家主席、中央军委主席习近平在人民大会堂亲切会见参加大会的新一届全国文明城市、文明村镇、文明单位、文明校园、未成年人思想道德建设工作先进代表和全国道德模范代表，向全体代表表示热烈的祝贺，勉励他们再接再厉，在社会主义精神文明建设中再立新功、作出表率。', 'http://resource.gbxx123.com/book/epubs/2017/11/20/1512024689373/ops/chapter1.html', '11', '216', '2018-01-04 16:41:11', '2018-01-04 16:41:11', '6', '0');
