INSERT INTO `t_discovery` VALUES ('552', '55468', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/7/17/1500276472942.jpg', '习近平“夜找书店”的故事', '在福建，习近平先后在宁德、福州担任党委一把手多年，如何加强党的建设，是他始终关注的问题，也是着力探索的问题。其中，思想建设、班子建设、基层组织建设是他重要的抓手。', 'http://resource.gbxx123.com/book/epubs/2017/7/17/1500276366100/ops/chapter1.html', '7', '220', '2018-01-04 16:56:03', '2018-01-04 16:56:03', '5', '0');
INSERT INTO `t_discovery` VALUES ('553', '55468', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/2/20/1487589762846.jpg', '习近平教你“闯”', '“路见不平一声吼哇!该出手时就出手哇!风风火火闯九州哇!”1998年刘欢的一首《好汉歌》以激昂的曲调红遍大江南北，唱出了数万人民群众的内心深处的“闯”。', 'http://resource.gbxx123.com/book/epubs/2017/2/20/1487589109566/ops/chapter1.html', '7', '220', '2018-01-04 16:56:32', '2018-01-04 16:56:32', '5', '0');
INSERT INTO `t_discovery` VALUES ('554', '55044', '1', '', null, 'http://xxzlres.xxzg123.com/images/ueditor/image/20170912/1505183569965025800.jpg', '百团大战', '百团大战是八路军与日军在华北地区的战役，战争初期战报统计（第一阶段）共达一百零五个团，因此定名为百团大战（原正太战役）。本战斗亦曾陆续被改编为同名电影。中国抗日战争中由中国共产党所率领的国民革命军第十八集团军（以下皆以八路军称呼），在1940年8月至1941年1月间发动的以破坏华北日军占领的交通线、矿山为目的的破袭作战（又称晋南游击战）。', 'http://xxzlres.xxzg123.com/index/vf/2017/9/12/150518357330621564.xml', '3', '237', '2018-01-04 19:58:11', '2018-01-04 19:58:11', '4', '0');
INSERT INTO `t_discovery` VALUES ('555', '55051', '1', '。', null, 'http://resource.gbxx123.com/site/image/courseware/2017/10/31/1509438914592.jpg', '向习近平学“用人之道”', '从隋灭的前车之鉴与唐兴的为政经验中，唐太宗总结得出：“为政之要，惟在得人。”《资治通鉴》对为政用人问题亦主张：“为治之要，莫先于用人。”纵览古今中外国运之兴衰，无不与“用人”有着密切联系。由此可见，政以才治，国以人兴，千秋大业，贵在用人。习近平总书记对“用人”的重视由来已久，十八大以来，习近平总书记更是就干部选任问题发表了大量重要论述。今天，“学习大军”就和大家一同去学学习近平总书记的“用人之道”。', 'http://resource.gbxx123.com/book/epubs/2017/10/31/1509438439387/ops/chapter1.html', '7', '220', '2018-01-04 20:05:27', '2018-01-04 20:05:27', '4', '0');
INSERT INTO `t_discovery` VALUES ('556', '55051', '1', '', null, 'http://resource.gbxx123.com/site/default/imageone.jpg', '毛泽东与人民解放军火箭军的组建', '​2015年12月31日，中国国家主席习近平将一面鲜艳的八一军旗亲手授予新任命的火箭军司令员魏凤和。从那一刻起，中国人民解放军第二炮兵正式更名为火箭军。', 'http://resource.gbxx123.com/book/epubs/2017/9/11/1505110639801/ops/chapter1.html', '7', '232', '2018-01-04 20:17:59', '2018-01-04 20:17:59', '4', '0');
INSERT INTO `t_discovery` VALUES ('557', '55051', '1', '', null, 'http://resource.gbxx123.com/site/default/imageone.jpg', '韩练成：最隐秘的隐形将军', '在1945年冬天的海口谈判中，国民党海南当局的最高谈判代表是时任四十六军军长的韩练成。而韩练成也是中国共产党深入龙潭虎穴的四大传奇将军之一，曾被蒋介石之子蒋经国称为“在老‘总统’身边隐藏时间最长、最隐秘的隐形将军”。', 'http://resource.gbxx123.com/book/epubs/2017/9/11/1505110639529/ops/chapter1.html', '7', '232', '2018-01-04 20:18:08', '2018-01-04 20:18:08', '4', '0');
