INSERT INTO `t_discovery` VALUES ('562', '55065', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/10/31/1509438914592.jpg', '向习近平学“用人之道”', '从隋灭的前车之鉴与唐兴的为政经验中，唐太宗总结得出：“为政之要，惟在得人。”《资治通鉴》对为政用人问题亦主张：“为治之要，莫先于用人。”纵览古今中外国运之兴衰，无不与“用人”有着密切联系。由此可见，政以才治，国以人兴，千秋大业，贵在用人。习近平总书记对“用人”的重视由来已久，十八大以来，习近平总书记更是就干部选任问题发表了大量重要论述。今天，“学习大军”就和大家一同去学学习近平总书记的“用人之道”。', 'http://resource.gbxx123.com/book/epubs/2017/10/31/1509438439387/ops/chapter1.html', '7', '220', '2018-01-04 21:23:26', '2018-01-04 21:23:26', '4', '0');
INSERT INTO `t_discovery` VALUES ('563', '55065', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/3/1514986002815.jpg', '中央军委举行2018年开训动员大会 习近平向全军发布训令 ', '新年伊始，万象更新，全军上下厉兵秣马，练兵正当时。3日上午，中央军委隆重举行2018年开训动员大会，中共中央总书记、国家主席、中央军委主席习近平向全军发布训令，号召全军贯彻落实党的十九大精神和新时代党的强军思想，全面加强实战化军事训练，全面提高打赢能力。', 'http://resource.gbxx123.com/book/epubs/2018/1/3/1514985934660/ops/chapter1.html', '7', '216', '2018-01-04 21:23:38', '2018-01-04 21:23:38', '4', '0');
