INSERT INTO `t_discovery` VALUES ('572', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/3/28/1490688108840.jpg', '习近平为群众再接访', '战国时期，诗人屈原一句“长太息以掩涕兮，哀民生之多艰”道出内心多少沉痛，又揭露出人民多少苦难。民生之艰，在不同的时代有不同的定义，但体察民情、解民忧却是殊途同归的。1988年，习近平在宁德地区工作时心系人民，贴近群众，大力倡导“四下基层”制度，即领导干部要“信访接待下基层、现场办公下基层、调查研究下基层、宣传党的方针政策下基层”。1990年，当习近平离开宁德到福州任市委书记时，“四下基层”制度并没有就此结束，他将这种工作制度和精神发挥得更为深入和具体了。', 'http://resource.gbxx123.com/book/epubs/2017/3/28/1490686051443/ops/chapter1.html', '7', '220', '2018-01-05 13:00:01', '2018-01-05 13:00:01', '3', '0');
INSERT INTO `t_discovery` VALUES ('573', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/3/16/1489647487058.jpg', '习近平谈改革的放与管', '“管”与“放”是一对孪生兄弟，他们互相帮助，互相扶持，少了谁都像是少了左膀右臂一样。在改革的大流中，“管”与“放”，更要做到这点，既要“放开”，又要综合“管理”。', 'http://resource.gbxx123.com/book/epubs/2017/3/16/1489642672492/ops/chapter1.html', '7', '220', '2018-01-05 13:00:17', '2018-01-05 13:00:17', '3', '0');
INSERT INTO `t_discovery` VALUES ('574', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/2/20/1487589762846.jpg', '习近平教你“闯”', '“路见不平一声吼哇!该出手时就出手哇!风风火火闯九州哇!”1998年刘欢的一首《好汉歌》以激昂的曲调红遍大江南北，唱出了数万人民群众的内心深处的“闯”。', 'http://resource.gbxx123.com/book/epubs/2017/2/20/1487589109566/ops/chapter1.html', '7', '220', '2018-01-05 13:00:36', '2018-01-05 13:00:36', '5', '0');
INSERT INTO `t_discovery` VALUES ('575', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/2/20/1487559906510.jpg', '习近平的“实干”', '习近平在《福州古厝》的序中写到：“福州派江吻海，山水相依，城中有山，山中有城，是一座天然环境优越、十分美丽的国家历史文化名城。”阳春三月的福州草长莺飞，好不热闹。为期六天的福州市九届人大六次会议圆满完成，于1992年3月4日上午在梅峰宾馆闭幕。时任福州市委书记、市人大常委会主任的习近平与众多领导一同参与大会。此次大会习近平又把“实干”圈出来，并且画上重点符号!古希腊伟大的哲学家德谟克利特曾经说过：“一切都靠一张嘴来做而丝毫不实干的人，是虚伪和假仁假义的。”那么在振兴福州这篇大文章上，习近平强调要怎么“实干”?', 'http://resource.gbxx123.com/book/epubs/2017/2/14/1487062766770/ops/chapter1.html', '7', '220', '2018-01-05 13:00:43', '2018-01-05 13:00:43', '5', '1');
INSERT INTO `t_discovery` VALUES ('576', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/12/13/1481598668352.jpg', '没有长远规划，很有可能留下永久遗憾', '1990年的福州迎来了变革的热潮，5月习近平就任福州市委书记，一上任他并非烧起“三把火”，而是开展了仔细的调研工作，很快他便摸清了福州市的“家底”，经济建设还不是特别理想，于是习近平在1992年的党代会上提出“必须要加快经济建设步伐，做到3-5年上一个新台阶。”习近平求发展，可是他还十分慎重地提出自己的建议，他认为改革开放的过程中许多重大的问题要从长计议，慎于决策，历史的经验告诉我们，一个地方的建设，如果没有长远规划，往往会导致建设中的严重失误，甚至留下永久遗憾。', 'http://resource.gbxx123.com/book/epubs/2016/12/13/1481597892937/ops/chapter1.html', '7', '220', '2018-01-05 13:01:01', '2018-01-05 13:01:01', '5', '0');
