INSERT INTO `t_discovery` VALUES ('588', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/10/31/1509438914592.jpg', '向习近平学“用人之道”', '从隋灭的前车之鉴与唐兴的为政经验中，唐太宗总结得出：“为政之要，惟在得人。”《资治通鉴》对为政用人问题亦主张：“为治之要，莫先于用人。”纵览古今中外国运之兴衰，无不与“用人”有着密切联系。由此可见，政以才治，国以人兴，千秋大业，贵在用人。习近平总书记对“用人”的重视由来已久，十八大以来，习近平总书记更是就干部选任问题发表了大量重要论述。今天，“学习大军”就和大家一同去学学习近平总书记的“用人之道”。', 'http://resource.gbxx123.com/book/epubs/2017/10/31/1509438439387/ops/chapter1.html', '7', '220', '2018-01-05 14:40:37', '2018-01-05 14:40:37', '5', '0');
INSERT INTO `t_discovery` VALUES ('589', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/4/20/1492670971170.jpg', '习近平：这一手不硬不行!', '俗话说：“民不容贪,法不护腐。”贪污腐败是罪大恶极之事，人人恨之入骨;贪官污吏是罪孽深重之徒，人人得而诛之。在反腐倡廉建设中，各机关各单位都无法置身事外、袖手旁观。而作为侦查、监督各类刑事案件，维护国家、社会安定和谐的检察机关,其第一位工作就是要反贪污贿赂，且这份工作必须做得坚决彻底，不留余地。习近平也早就说过，这一手不硬不行!', 'http://resource.gbxx123.com/book/epubs/2017/4/20/1492668789069/ops/chapter1.html', '7', '220', '2018-01-05 14:40:43', '2018-01-05 14:40:43', '5', '0');
INSERT INTO `t_discovery` VALUES ('590', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/4/11/1491895933196.jpg', '习近平“回”过很多信，这封你一定不知道', '1992年4月24日，习近平收到一封来自当年山西省霍州市委统战部的三位同志的信，信件主要内容是，三人出差到福州，在购买回程汽车票时，被未经审批的售票摊点所骗。', 'http://resource.gbxx123.com/book/epubs/2017/4/11/1491895401964/ops/chapter1.html', '7', '220', '2018-01-05 14:40:49', '2018-01-05 14:40:49', '5', '0');
INSERT INTO `t_discovery` VALUES ('591', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/3/27/1490606156972.jpg', '习近平谈改革的破与立', '古语道：“不破不立，不塞不流，不止不行。”其中“破”即为破除，“立”即为树立。换而言之，破与立是一个新拐点，这种辩证思维适用于个人的成长，也适用于国家的发展。', 'http://resource.gbxx123.com/book/epubs/2017/3/27/1490604866482/ops/chapter1.html', '7', '220', '2018-01-05 14:40:54', '2018-01-05 14:40:54', '7', '0');
INSERT INTO `t_discovery` VALUES ('592', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/12/15/1481793464195.jpg', '当年习近平工业发展有方略', '“银羊辞岁千祥聚，金猴闹春万象新。”1992年2月2日正值农历辛未年十二月二十九，除夕前夕。人们举家欢庆，幸福洋溢，好生热闹。而此时的福州市委书记习近平顾不上小家团圆，正忙着召开福州市工交工作会议呢。', 'http://resource.gbxx123.com/book/epubs/2016/12/15/1481792778545/ops/chapter1.html', '7', '220', '2018-01-05 14:41:03', '2018-01-05 14:41:03', '7', '0');
INSERT INTO `t_discovery` VALUES ('593', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/11/21/1479715186410.jpg', '公安干警文明执法，习近平早有要求', '刷看新闻，公安干警罔顾纲纪的执法乱象、以权谋利的不正之风总能隔三差五地“光顾”媒体头版，频频“吸睛”，掀起网民阵阵热议。', 'http://resource.gbxx123.com/book/epubs/2016/11/21/1479714311891/ops/chapter1.html', '7', '220', '2018-01-05 14:41:08', '2018-01-05 14:41:08', '7', '0');
INSERT INTO `t_discovery` VALUES ('594', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/11/16/1479285090823.jpg', '习近平谈先进人物', '时下中央电视台公益活动《感动中国》年度人物评选很火爆，这是现代传媒宣传先进人物的一种方式。实际上每年党委、政府组织单位评选先进人物，你看着是不是也心动？还是怕自己不够格？别担心，来读读这篇文章，你就没有这方面的烦恼了。', 'http://resource.gbxx123.com/book/epubs/2016/11/16/1479282662601/ops/chapter1.html', '7', '220', '2018-01-05 14:41:13', '2018-01-05 14:41:13', '7', '0');
INSERT INTO `t_discovery` VALUES ('595', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/10/21/1477029601431.jpg', '习近平鼓励实干苦干', '“一个人正如一只时钟，是以他的行动来定其价值的。”做任何事情，只有投入到实践中去，以持之以恒、滴水穿石的精神实干苦干，才能在激烈的竞争中脱颖而出、百炼成钢。', 'http://resource.gbxx123.com/book/epubs/2016/10/21/1477028585416/ops/chapter1.html', '7', '220', '2018-01-05 14:41:18', '2018-01-05 14:41:18', '7', '0');
INSERT INTO `t_discovery` VALUES ('596', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/9/21/1474444011180.jpg', '习近平给“小巷总理”的祝福与众不同', '祝福语是指对人们的美好祝福的语句。祝福语在社会发展中已经不是仅限于节日和宴会上，常见的节日互发手机信息祝福，天气冷暖变化问候祝福，朋友日常间的鼓励祝福，每天的清晨晚间问候祝福等等。祝福语已经各种各样，可以是感动的，兴奋的，幽默的等等。这些祝福中，反映出人与人之间的感情增进和友善的交流。但有个人的祝福与众不同。', 'http://resource.gbxx123.com/book/epubs/2016/9/21/1474443088853/ops/chapter1.html', '7', '220', '2018-01-05 14:41:35', '2018-01-05 14:41:35', '9', '0');
INSERT INTO `t_discovery` VALUES ('597', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/9/13/1473752155120.jpg', '习近平与“草鞋亲戚”的故事', '下党乡是福建省寿宁县最边远的山乡，素有“寿宁的西伯利亚”之称。这里曾经是无公路、无自来水、无电灯照明、无财政收入、无政府办公场所的“五无乡镇”，所在地通往四处毗邻乡镇，都得翻山越岭步行10多公里。1988年建乡时，农民年人均收入不足200元。', 'http://resource.gbxx123.com/book/epubs/2016/9/13/1473751127264/ops/chapter1.html', '7', '220', '2018-01-05 14:41:44', '2018-01-05 14:41:44', '8', '0');
INSERT INTO `t_discovery` VALUES ('598', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/9/5/1473066001131.jpg', '一桌酒席见证习大大的真爱', '“众里寻他千百度，那人却在灯火阑珊处”。习近平与彭丽媛初见一面，彼此就认定了对方是与自己共度一生的人。', 'http://resource.gbxx123.com/book/epubs/2016/9/5/1473065176655/ops/chapter1.html', '7', '220', '2018-01-05 14:41:56', '2018-01-05 14:41:56', '9', '0');
INSERT INTO `t_discovery` VALUES ('599', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/8/24/1472001126240.jpg', '习大大指挥“绿色战役”', '1990年初冬时分，位于福建东部的榕城福州，丝毫未沾染半分冬天的萧条与死寂。只因它多了绿色的点缀，一切都变得生动活泼起来。这一年，时任福州市委书记的习近平带领广大干部群众打了一场漂亮的绿色翻身仗。', 'http://resource.gbxx123.com/book/epubs/2016/8/24/1472000169723/ops/chapter1.html', '7', '220', '2018-01-05 14:42:03', '2018-01-05 14:42:03', '9', '0');
INSERT INTO `t_discovery` VALUES ('600', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2015/12/22/1450766565306.jpg', '习近平眼中最高尚的职业是什么?', '有这样一群人：他们每天迎接城市第一缕晨曦，无论严寒酷暑，日复一日；他们与垃圾为伴，为少数人的不文明埋单，点缀着城市的繁华；他们用自己的双手和汗水换来了街道的整洁，城市的美好……他们便是我们可爱的城市环卫工人!每逢节假日，便是环卫工人最忙最累的时候，年复一年，多少环卫工人在他们的岗位上迎接节日的到来。', 'http://resource.gbxx123.com/book/epubs/2015/12/22/1450763775776/ops/chapter1.html', '7', '220', '2018-01-05 14:42:08', '2018-01-05 14:42:08', '9', '0');
INSERT INTO `t_discovery` VALUES ('601', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2015/6/8/1433741699878.jpg', '忆习近平：很低调 有点“土”', '20世纪80年代初期，由于工作关系，我和习近平同志在河北省正定县曾经同事。一起工作的日子，给我留下了难忘而美好的记忆。', 'http://resource.gbxx123.com/book/epubs/2015/6/8/1433740255343/ops/chapter1.html', '7', '220', '2018-01-05 14:42:15', '2018-01-05 14:42:15', '8', '0');
INSERT INTO `t_discovery` VALUES ('602', '54838', '1', '', null, 'http://xxzlres.xxzg123.com/images/ueditor/image/20170912/1505205979576031284.png', '建指挥中枢', '建指挥中枢', 'http://xxzlres.xxzg123.com/article/wa/zy/2017/9/9/150496309801821123.html', '7', '222', '2018-01-05 14:43:52', '2018-01-05 14:43:52', '10', '0');
INSERT INTO `t_discovery` VALUES ('603', '55052', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/11/13/1510542413213.jpg', '习近平抵达河内开始对越南社会主义共和国进行国事访问', '中共中央总书记、国家主席习近平11月12日抵达河内，开始对越南社会主义共和国进行国事访问。', 'http://resource.gbxx123.com/book/epubs/2017/11/13/1510542017398/ops/chapter1.html', '7', '216', '2018-01-05 14:47:25', '2018-01-05 14:47:25', '8', '0');
INSERT INTO `t_discovery` VALUES ('604', '55060', '1', '今年注定是不平凡的一年，注定是我们生命不可或缺的一年，我有信心我们将会成长的越来越快，为祖国的强大梦想不断灌注前进动力。', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/3/1514986002815.jpg', '中央军委举行2018年开训动员大会 习近平向全军发布训令 ', '新年伊始，万象更新，全军上下厉兵秣马，练兵正当时。3日上午，中央军委隆重举行2018年开训动员大会，中共中央总书记、国家主席、中央军委主席习近平向全军发布训令，号召全军贯彻落实党的十九大精神和新时代党的强军思想，全面加强实战化军事训练，全面提高打赢能力。', 'http://resource.gbxx123.com/book/epubs/2018/1/3/1514985934660/ops/chapter1.html', '7', '216', '2018-01-05 14:49:57', '2018-01-05 14:49:57', '5', '0');
INSERT INTO `t_discovery` VALUES ('605', '55472', '1', '', null, 'http://xxzlres.xxzg123.com/images/ueditor/image/20170912/1505206398789019075.png', '亲临救灾一线', '亲临救灾一线', 'http://xxzlres.xxzg123.com/article/wa/zy/2017/9/9/150496316197221124.html', '7', '222', '2018-01-05 14:51:04', '2018-01-05 14:51:04', '5', '0');
INSERT INTO `t_discovery` VALUES ('606', '55044', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/10/27/1477550329739.jpg', '习近平怎么关心“三农”工作', '有首歌这么唱到：“我心中，你最重，悲欢共，生死同……”每个人心中都珍藏着极其重要的人和事，而在我们习近平的心中，想必只有人民最重，也只有脱贫致富奔小康，在他心中最有份量。只要事关三农问题，习近平总是千方百计去部署工作；只要事关农民的收入，习近平都竭尽全力让他们满意。', 'http://resource.gbxx123.com/book/epubs/2016/10/27/1477549051835/ops/chapter1.html', '7', '220', '2018-01-05 14:51:32', '2018-01-05 14:51:32', '6', '0');
INSERT INTO `t_discovery` VALUES ('607', '55472', '1', '', null, 'http://xxzlres.xxzg123.com/images/ueditor/image/20171215/1513341251151089077.jpg', '习近平谈理想信念', '习近平谈理想信念', 'http://xxzlres.xxzg123.com/article/wa/zy/2017/12/15/151334142914526743.html', '7', '285', '2018-01-05 14:53:19', '2018-01-05 14:53:19', '6', '0');
INSERT INTO `t_discovery` VALUES ('608', '55472', '1', '', null, '', '习近平精彩语录', '习近平精彩语录', 'http://xxzlres.xxzg123.com/article/wa/zy/2017/12/3/151229053564826253.html', '7', '285', '2018-01-05 14:54:15', '2018-01-05 14:54:15', '4', '0');
INSERT INTO `t_discovery` VALUES ('609', '55472', '1', '', null, '', '品读习主席讲话中引用的古文经典名句', '中华优秀传统文化中的很多经典名句言简意赅，蕴含着立身做人、为官理政的丰富哲理，有力彰显了中华民族的文化精神。习主席在多次讲话中引用的这些经典名句，就像一颗颗珍珠，闪耀着理论和实践的光辉，值得大家认真品读、仔细体味。', 'http://xxzlres.xxzg123.com/article/wa/zy/2017/12/3/151229021786026252.html', '7', '285', '2018-01-05 14:54:22', '2018-01-05 14:54:22', '4', '0');
INSERT INTO `t_discovery` VALUES ('610', '55472', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/5/1515116657533.jpg', '花叶死亡之日', '南洋富商席有仁远赴日本与恩人会面，却不料刚到日本，身边就接二连三地发生命案——先是独居老人被绞杀，后是地方政客的侄子中毒身亡，紧接着他的恩人竟然也因煤气中毒而死！一系列扑朔迷离的杀人案件，凶手却未留下任何蛛丝马迹，揭开真相的关键到底在哪里？　　但是真相总会大白。只是当拨开重重疑云之际，那份历经岁月蹉跎的情感，不知是否依然和从前一样隽永甘醇……　　　', 'http://resource.gbxx123.com/index/studyPlatform/eb/2018/1/102277.xml', '6', '247', '2018-01-05 14:55:56', '2018-01-05 14:55:56', '5', '0');
