INSERT INTO `t_discovery` VALUES ('614', '55475', '1', '亚太哦', null, 'http://resource.gbxx123.com/site/image/courseware/2017/11/10/1510281445582.jpg', '习近平离京出席亚太经合组织第二十五次领导人非正式会议并对越南社会主义共和国、老挝人民民主共和国进行国事访问', '中共中央总书记、国家主席习近平11月10日上午乘专机离开北京，应越南社会主义共和国主席陈大光邀请，赴越南岘港出席亚太经合组织第二十五次领导人非正式会议；应越南共产党中央委员会总书记阮富仲、越南社会主义共和国主席陈大光，老挝人民革命党中央委员会总书记、老挝人民民主共和国主席本扬邀请，对越南、老挝进行国事访问。', 'http://resource.gbxx123.com/book/epubs/2017/11/10/1510281226466/ops/chapter1.html', '7', '216', '2018-01-05 15:00:12', '2018-01-05 15:00:12', '6', '0');
INSERT INTO `t_discovery` VALUES ('615', '55475', '1', '学习就是成长，哦了', null, 'http://resource.gbxx123.com/site/image/courseware/2016/12/7/1481099964870.jpg', '习近平说：要学习、学习、再学习', '一日不书，百事荒芜。读书是修身养性的关键；学习是自我提升的前提。一个人如果不读书、不学习，就像一个空壳，难以进步，毫无用处。习近平的爱学习、爱读书，众所周知。早在任福州市委书记时，他就强调，要加强党建理论学习，推进党的自身建设。', 'http://resource.gbxx123.com/book/epubs/2016/12/7/1481098539537/ops/chapter1.html', '7', '220', '2018-01-05 15:04:04', '2018-01-05 15:04:04', '6', '1');
INSERT INTO `t_discovery` VALUES ('616', '55475', '1', '新时代的名言\n', null, 'http://xxzlres.xxzg123.com/images/ueditor/image/20171205/1512467415378051683.jpg', '习近平治国理政100个金句，读懂十八大以来这五年（七）', '习近平治国理政100个金句，读懂十八大以来这五年（七）', 'http://xxzlres.xxzg123.com/article/wa/zy/2017/12/5/151246742304126351.html', '7', '224', '2018-01-05 15:07:48', '2018-01-05 15:07:48', '4', '0');
INSERT INTO `t_discovery` VALUES ('617', '55475', '1', '可以说我们90后有担当吗\n', null, 'http://xxzlres.xxzg123.com/images/ueditor/image/20170912/1505207829047036386.png', '走好“90后”官兵的信仰之路', '走好“90后”官兵的信仰之路', 'http://xxzlres.xxzg123.com/article/wa/zy/2017/9/10/150505022077121359.html', '7', '246', '2018-01-05 15:17:10', '2018-01-05 15:17:10', '3', '0');
INSERT INTO `t_discovery` VALUES ('618', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/3/1514986002815.jpg', '中央军委举行2018年开训动员大会 习近平向全军发布训令 ', '新年伊始，万象更新，全军上下厉兵秣马，练兵正当时。3日上午，中央军委隆重举行2018年开训动员大会，中共中央总书记、国家主席、中央军委主席习近平向全军发布训令，号召全军贯彻落实党的十九大精神和新时代党的强军思想，全面加强实战化军事训练，全面提高打赢能力。', 'http://resource.gbxx123.com/book/epubs/2018/1/3/1514985934660/ops/chapter1.html', '7', '216', '2018-01-05 15:18:35', '2018-01-05 15:18:35', '2', '0');
INSERT INTO `t_discovery` VALUES ('619', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/5/1515114643364.jpg', '习近平：大抓实战化军事训练 聚力打造精锐作战力量', '中共中央总书记、国家主席、中央军委主席习近平1月3日视察中部战区陆军某师，强调要认真贯彻党的十九大精神，贯彻新时代党的强军思想，大抓实战化军事训练，深入推进数字化部队建设管理和作战运用创新，聚力打造精锐作战力量。', 'http://resource.gbxx123.com/book/epubs/2018/1/5/1515114559406/ops/chapter1.html', '7', '216', '2018-01-05 15:18:45', '2018-01-05 15:18:45', '2', '0');
INSERT INTO `t_discovery` VALUES ('620', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/3/1514942939958.jpg', '习近平同南非总统祖马就中南建交20周年互致贺电', '国家主席习近平1月1日同南非总统祖马互致贺电，热烈庆祝中南建交20周年。', 'http://resource.gbxx123.com/book/epubs/2018/1/3/1514946121506/ops/chapter1.html', '11', '216', '2018-01-05 15:18:52', '2018-01-05 15:18:52', '3', '0');
INSERT INTO `t_discovery` VALUES ('621', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/1/1514779706637.jpg', '国家主席习近平发表二〇一八年新年贺词 ', '新年前夕，国家主席习近平通过中国国际广播电台、中央人民广播电台、中央电视台、中国国际电视台（中国环球电视网）和互联网，发表了二〇一八年新年贺词。', 'http://resource.gbxx123.com/book/epubs/2018/1/1/1514945865945/ops/chapter1.html', '11', '216', '2018-01-05 15:19:00', '2018-01-05 15:19:00', '3', '0');
INSERT INTO `t_discovery` VALUES ('622', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/3/1514942835593.jpg', '中俄两国元首互致新年贺电', '2017年12月31日，国家主席习近平和俄罗斯总统普京互致新年贺电。', 'http://resource.gbxx123.com/book/epubs/2018/1/3/1514945375951/ops/chapter1.html', '11', '216', '2018-01-05 15:19:12', '2018-01-05 15:19:12', '3', '0');
INSERT INTO `t_discovery` VALUES ('623', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/3/1514942889224.jpg', '习近平回信勉励莫斯科大学中国留学生', '在新年来临之际，中共中央总书记、国家主席、中央军委主席习近平12月30日给莫斯科大学的中国留学生回信，勉励他们胸怀大志、刻苦学习、早日成才，并向所有海外学人致以节日问候。', 'http://resource.gbxx123.com/book/epubs/2018/1/3/1514945589525/ops/chapter1.html', '11', '216', '2018-01-05 15:19:19', '2018-01-05 15:19:19', '4', '0');
INSERT INTO `t_discovery` VALUES ('624', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/29/1514552341435.jpg', '中央农村工作会议在北京举行 习近平作重要讲话 ', '中央农村工作会议12月28日至29日在北京举行。会议深入贯彻党的十九大精神、习近平新时代中国特色社会主义思想，全面分析“三农”工作面临的形势和任务，研究实施乡村振兴战略的重要政策，部署2018年和今后一个时期的农业农村工作。', 'http://resource.gbxx123.com/book/epubs/2017/12/29/1514945737976/ops/chapter1.html', '11', '216', '2018-01-05 15:19:26', '2018-01-05 15:19:26', '3', '0');
INSERT INTO `t_discovery` VALUES ('625', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/27/1514335484541.jpg', '中共中央政治局召开民主生活会 习近平发表重要讲话', '中共中央政治局于12月25日至26日召开民主生活会，以认真学习领会习近平新时代中国特色社会主义思想、坚定维护以习近平同志为核心的党中央权威和集中统一领导、全面贯彻落实党的十九大各项决策部署为主题，重点对照《中共中央政治局关于加强和维护党中央集中统一领导的若干规定》《中共中央政治局贯彻落实中央八项规定实施细则》，联系中央政治局工作，联系带头执行中央八项规定的实际，联系狠抓党的十九大决策部署的实际，进行自我检查、党性分析，开展批评和自我批评。', 'http://resource.gbxx123.com/book/epubs/2017/12/27/1514944866203/ops/chapter1.html', '11', '216', '2018-01-05 15:19:39', '2018-01-05 15:19:39', '4', '0');
INSERT INTO `t_discovery` VALUES ('626', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/25/1514191349364.jpg', '习近平：把农村公路建好管好护好运营好', '中共中央总书记、国家主席、中央军委主席习近平近日对“四好农村路”建设作出重要指示。', 'http://resource.gbxx123.com/book/epubs/2017/12/25/1514944713966/ops/chapter1.html', '11', '216', '2018-01-05 15:19:50', '2018-01-05 15:19:50', '4', '0');
INSERT INTO `t_discovery` VALUES ('627', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/22/1513906352719.jpg', '习近平同冈比亚总统巴罗举行会谈', '国家主席习近平12月21日在人民大会堂同来华进行国事访问的冈比亚总统巴罗举行会谈。两国元首一致同意，共同规划好中冈合作新蓝图，推动双边关系持续深入发展。', 'http://resource.gbxx123.com/book/epubs/2017/12/22/1514364495477/ops/chapter1.html', '11', '216', '2018-01-05 15:20:03', '2018-01-05 15:20:03', '2', '0');
INSERT INTO `t_discovery` VALUES ('628', '55046', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/4/20/1492670971170.jpg', '习近平：这一手不硬不行!', '俗话说：“民不容贪,法不护腐。”贪污腐败是罪大恶极之事，人人恨之入骨;贪官污吏是罪孽深重之徒，人人得而诛之。在反腐倡廉建设中，各机关各单位都无法置身事外、袖手旁观。而作为侦查、监督各类刑事案件，维护国家、社会安定和谐的检察机关,其第一位工作就是要反贪污贿赂，且这份工作必须做得坚决彻底，不留余地。习近平也早就说过，这一手不硬不行!', 'http://resource.gbxx123.com/book/epubs/2017/4/20/1492668789069/ops/chapter1.html', '7', '220', '2018-01-05 15:25:54', '2018-01-05 15:25:54', '2', '0');
INSERT INTO `t_discovery` VALUES ('629', '55046', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/10/31/1509438914592.jpg', '向习近平学“用人之道”', '从隋灭的前车之鉴与唐兴的为政经验中，唐太宗总结得出：“为政之要，惟在得人。”《资治通鉴》对为政用人问题亦主张：“为治之要，莫先于用人。”纵览古今中外国运之兴衰，无不与“用人”有着密切联系。由此可见，政以才治，国以人兴，千秋大业，贵在用人。习近平总书记对“用人”的重视由来已久，十八大以来，习近平总书记更是就干部选任问题发表了大量重要论述。今天，“学习大军”就和大家一同去学学习近平总书记的“用人之道”。', 'http://resource.gbxx123.com/book/epubs/2017/10/31/1509438439387/ops/chapter1.html', '7', '220', '2018-01-05 15:26:02', '2018-01-05 15:26:02', '3', '0');
