INSERT INTO `t_discovery` VALUES ('633', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/21/1513816728762.jpg', '中央经济工作会议举行　习近平李克强作重要讲话', '中央经济工作会议12月18日至20日在北京举行。中共中央总书记、国家主席、中央军委主席习近平，中共中央政治局常委、国务院总理李克强，国务院副总理张高丽，中共中央政治局常委栗战书、汪洋、王沪宁、赵乐际、韩正出席会议。', 'http://resource.gbxx123.com/book/epubs/2017/12/21/1514363185051/ops/chapter1.html', '11', '216', '2018-01-05 15:29:02', '2018-01-05 15:29:02', '4', '0');
INSERT INTO `t_discovery` VALUES ('634', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/18/1513558736296.jpg', '习近平会见来京述职的崔世安', '国家主席习近平12月15日下午在中南海瀛台会见了来京述职的澳门特别行政区行政长官崔世安，听取了他对澳门当前形势和特别行政区政府工作情况的汇报。', 'http://resource.gbxx123.com/book/epubs/2017/12/18/1514363914978/ops/chapter1.html', '11', '216', '2018-01-05 15:29:28', '2018-01-05 15:29:28', '4', '0');
