INSERT INTO `t_discovery` VALUES ('641', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/5/1515158964017.jpg', '习近平：以时不我待只争朝夕的精神投入工作 开创新时代中国特色社会主义事业新局面 ', '新进中央委员会的委员、候补委员和省部级主要领导干部学习贯彻习近平新时代中国特色社会主义思想和党的十九大精神研讨班5日上午在中央党校开班。', 'http://resource.gbxx123.com/book/epubs/2018/1/5/1515158797833/ops/chapter1.html', '7', '216', '2018-01-06 19:02:39', '2018-01-06 19:02:39', '1', '0');
INSERT INTO `t_discovery` VALUES ('642', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/5/1515114643364.jpg', '习近平：大抓实战化军事训练 聚力打造精锐作战力量', '中共中央总书记、国家主席、中央军委主席习近平1月3日视察中部战区陆军某师，强调要认真贯彻党的十九大精神，贯彻新时代党的强军思想，大抓实战化军事训练，深入推进数字化部队建设管理和作战运用创新，聚力打造精锐作战力量。', 'http://resource.gbxx123.com/book/epubs/2018/1/5/1515114559406/ops/chapter1.html', '7', '216', '2018-01-06 19:02:54', '2018-01-06 19:02:54', '1', '0');
INSERT INTO `t_discovery` VALUES ('643', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/3/1514942889224.jpg', '习近平回信勉励莫斯科大学中国留学生', '在新年来临之际，中共中央总书记、国家主席、中央军委主席习近平12月30日给莫斯科大学的中国留学生回信，勉励他们胸怀大志、刻苦学习、早日成才，并向所有海外学人致以节日问候。', 'http://resource.gbxx123.com/book/epubs/2018/1/3/1514945589525/ops/chapter1.html', '11', '216', '2018-01-06 19:03:04', '2018-01-06 19:03:04', '1', '0');
INSERT INTO `t_discovery` VALUES ('644', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/29/1514550533835.jpg', '习近平会见出席中日执政党交流机制第七次会议的日方代表 ', '中共中央总书记、国家主席习近平12月28日在北京会见来华出席中日执政党交流机制第七次会议的日本自民党干事长二阶俊博、公明党干事长井上义久及其率领的代表团。', 'http://resource.gbxx123.com/book/epubs/2017/12/29/1514944587734/ops/chapter1.html', '11', '216', '2018-01-06 19:03:14', '2018-01-06 19:03:14', '1', '0');
INSERT INTO `t_discovery` VALUES ('645', '55471', '0', '习近平强调，建设好我们这样的大党，领导好我们这样的大国，中央委员会成员和省部级主要领导干部至关重要，必须提高政治站位、树立历史眼光、强化理论思维、增强大局观念、丰富知识素养、坚持问题导向，从历史和现实相贯通、国际和国内相关联、理论和实际相结合的宽广视角，对一些重大理论和实践问题进行思考和把握，做到坚持和发展中国特色社会主义要一以贯之，推进党的建设新的伟大工程要一以贯之，增强忧患意识、防范风险挑战要', null, null, null, null, null, null, null, '2018-01-06 22:16:56', '2018-01-06 22:16:56', '1', '0');
INSERT INTO `t_discovery` VALUES ('646', '55471', '0', '习近平强调，建设好我们这样的大党，领导好我们这样的大国，中央委员会成员和省部级主要领导干部至关重要，必须提高政治站位、树立历史眼光、强化理论思维、增强大局观念、丰富知识素养、坚持问题导向，从历史和现实相贯通、国际和国内相关联、理论和实际相结合的宽广视角，对一些重大理论和实践问题进行思考和把握，做到坚持和发展中国特色社会主义要一以贯之，推进党的建设新的伟大工程要一以贯之，增强忧患意识、防范风险挑战要', null, null, null, null, null, null, null, '2018-01-06 22:17:10', '2018-01-06 22:17:10', '1', '0');
INSERT INTO `t_discovery` VALUES ('647', '55471', '1', '全军各级要强化练兵备战鲜明导向，坚定不移把军事训练摆在战略位置、作为中心工作，抓住不放，抓出成效。要坚持领导带头、以上率下，坚持实战实训、联战联训，坚持按纲施训、从严治训。要端正训练作风、创新训练方法、完善训练保障、严格训练监察，开展群众性练兵比武活动，加强针对性对抗性训练，提高军事训练实战化水平，牢牢掌握能打仗、打胜仗的过硬本领', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/3/1514986002815.jpg', '中央军委举行2018年开训动员大会 习近平向全军发布训令 ', '新年伊始，万象更新，全军上下厉兵秣马，练兵正当时。3日上午，中央军委隆重举行2018年开训动员大会，中共中央总书记、国家主席、中央军委主席习近平向全军发布训令，号召全军贯彻落实党的十九大精神和新时代党的强军思想，全面加强实战化军事训练，全面提高打赢能力。', 'http://resource.gbxx123.com/book/epubs/2018/1/3/1514985934660/ops/chapter1.html', '7', '216', '2018-01-06 22:19:51', '2018-01-06 22:19:51', '1', '0');
INSERT INTO `t_discovery` VALUES ('648', '55471', '1', '做中华优秀传统文化的执着继承者、自觉传播者和带头实践者。', null, 'http://xxzlres.xxzg123.com/images/km/2.jpg', '【喜迎十九大】怎样炼成好党员', '该书围绕共产党员“怎样炼成好思想、怎样锤炼铁纪律、怎样练就好德行、怎样展现新作为”等理论和现实问题，通过大量事实和热点案例，深入浅出地阐释了共产党员践行“四讲四有”标准的思想和工作方法。', 'http://resource.gbxx123.com/mindmap/2017/10/8/1507428580157/1507428580157.json', '5', '218', '2018-01-06 22:24:55', '2018-01-06 22:24:55', '0', '0');
INSERT INTO `t_discovery` VALUES ('649', '55471', '1', '做中华优秀传统文化的执着继承者、自觉传播者和带头实践者。做中华优秀传统文化的执着继承者、自觉传播者和带头实践者。做中华优秀传统文化的执着继承者、自觉传播者和带头实践者。做中华优秀传统文化的执着继承者、自觉传播者和带头实践者。做中华优秀传统文化的执着继承者、自觉传播者和带头实践者。做中华优秀传统文化的执着继承者、自觉传播者和带头实践者。', null, 'http://xxzlres.xxzg123.com/images/km/10.jpg', '习近平讲故事', '《习近平讲故事》一书，共收入109则故事，分为对内篇和对外篇。对内篇包括廉政、品格、励志、治理等；对外篇侧重于人民友好、国家交往、文化融通、历史情感等。每则故事在引用原文之外，还配有“延伸阅读”，用以丰富故事细节，还原故事语境，让读者更好地体悟故事背后的改革发展之道、大国外交之道、修身为人之道。', 'http://resource.gbxx123.com/mindmap/2017/8/23/1503453423302/1503453423302.json', '5', '218', '2018-01-06 22:25:15', '2018-01-06 22:25:15', '1', '0');
INSERT INTO `t_discovery` VALUES ('650', '55283', '1', '以时不我待只争朝夕的精神投入工作', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/5/1515158964017.jpg', '习近平：以时不我待只争朝夕的精神投入工作 开创新时代中国特色社会主义事业新局面 ', '新进中央委员会的委员、候补委员和省部级主要领导干部学习贯彻习近平新时代中国特色社会主义思想和党的十九大精神研讨班5日上午在中央党校开班。', 'http://resource.gbxx123.com/book/epubs/2018/1/5/1515158797833/ops/chapter1.html', '7', '216', '2018-01-07 08:13:13', '2018-01-07 08:13:13', '2', '0');
INSERT INTO `t_discovery` VALUES ('651', '55283', '1', '', null, 'http://xxzlres.xxzg123.com/images/km/7.jpg', '习仲勋传', '一代政治家习仲勋的奋斗传奇首度面世！最权威、最详实、最全面。编撰历时20年、长达94万字、150幅珍贵照片。年仅20岁的习仲勋为何被陕甘边区的人民称为“群众领袖”？在抗日战争和解放战争时期习仲勋是如何独当一面、如何协助贺龙、彭德怀等为保卫陕甘宁边区、保卫延安、解放大西北而浴血奋战彪炳史册？毛泽东为何夸奖主持中央西北局工作的习仲勋“年轻有为”、“炉火纯青”？在担任国务院秘书长和副总理期间习仲勋是如何协助周总理工作的？在遭受诬陷和迫害期间习仲勋是如何坚持真理、坚信党和人民的？在改革开放初期习仲勋受命在广东是如何“杀出一条血路”的？习仲勋在主持中央书记处常务工作期间是如何致力新时期党的建设工作的？习仲勋如何同人民群众保持血肉联系、关心民族宗教领袖、严格家教家风的？', 'http://resource.gbxx123.com/mindmap/2017/5/22/1495414855053/1495414855053.json', '5', '218', '2018-01-07 08:14:01', '2018-01-07 08:14:01', '1', '0');
INSERT INTO `t_discovery` VALUES ('652', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/8/1512694377454.jpg', '习近平向“中国－瑞士旅游年”闭幕式致贺词', '“中国－瑞士旅游年”12月7日在瑞士洛桑闭幕。国家主席习近平向闭幕式致贺词。', 'http://resource.gbxx123.com/book/epubs/2017/12/8/1513328694037/ops/chapter1.html', '11', '216', '2018-01-07 08:18:44', '2018-01-07 08:18:44', '0', '0');
INSERT INTO `t_discovery` VALUES ('653', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/8/1512694324659.jpg', '习近平同马尔代夫总统亚明举行会谈', '国家主席习近平12月7日在人民大会堂同来华进行国事访问的马尔代夫总统亚明举行会谈。', 'http://resource.gbxx123.com/book/epubs/2017/12/8/1513750426555/ops/chapter1.html', '11', '216', '2018-01-07 08:18:51', '2018-01-07 08:18:51', '0', '0');
INSERT INTO `t_discovery` VALUES ('654', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/11/30/1512015885844.jpg', '习近平应约同美国总统特朗普通电话', '国家主席习近平11月29日应约同美国总统特朗普通电话。', 'http://resource.gbxx123.com/book/epubs/2017/11/30/1512633175013/ops/chapter1.html', '11', '216', '2018-01-07 08:19:03', '2018-01-07 08:19:03', '0', '0');
INSERT INTO `t_discovery` VALUES ('655', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/12/15/1481793464195.jpg', '当年习近平工业发展有方略', '“银羊辞岁千祥聚，金猴闹春万象新。”1992年2月2日正值农历辛未年十二月二十九，除夕前夕。人们举家欢庆，幸福洋溢，好生热闹。而此时的福州市委书记习近平顾不上小家团圆，正忙着召开福州市工交工作会议呢。', 'http://resource.gbxx123.com/book/epubs/2016/12/15/1481792778545/ops/chapter1.html', '7', '220', '2018-01-07 18:29:16', '2018-01-07 18:29:16', '0', '0');
INSERT INTO `t_discovery` VALUES ('656', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/11/21/1479697503611.jpg', '习大大眼中最可敬的人', '2016年，“六一”儿童节来临之际，习近平总书记回信勉励浙江大陈岛老垦荒队员后代，为继承最可敬的人的可贵精神的建设者们送去祝福。', 'http://resource.gbxx123.com/book/epubs/2016/11/21/1479695614732/ops/chapter1.html', '7', '220', '2018-01-07 18:29:28', '2018-01-07 18:29:28', '0', '0');
INSERT INTO `t_discovery` VALUES ('657', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/10/21/1477029601431.jpg', '习近平鼓励实干苦干', '“一个人正如一只时钟，是以他的行动来定其价值的。”做任何事情，只有投入到实践中去，以持之以恒、滴水穿石的精神实干苦干，才能在激烈的竞争中脱颖而出、百炼成钢。', 'http://resource.gbxx123.com/book/epubs/2016/10/21/1477028585416/ops/chapter1.html', '7', '220', '2018-01-07 18:29:36', '2018-01-07 18:29:36', '0', '0');
INSERT INTO `t_discovery` VALUES ('658', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/9/13/1473752155120.jpg', '习近平与“草鞋亲戚”的故事', '下党乡是福建省寿宁县最边远的山乡，素有“寿宁的西伯利亚”之称。这里曾经是无公路、无自来水、无电灯照明、无财政收入、无政府办公场所的“五无乡镇”，所在地通往四处毗邻乡镇，都得翻山越岭步行10多公里。1988年建乡时，农民年人均收入不足200元。', 'http://resource.gbxx123.com/book/epubs/2016/9/13/1473751127264/ops/chapter1.html', '7', '220', '2018-01-07 18:29:47', '2018-01-07 18:29:47', '0', '0');
INSERT INTO `t_discovery` VALUES ('659', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/9/5/1473066001131.jpg', '一桌酒席见证习大大的真爱', '“众里寻他千百度，那人却在灯火阑珊处”。习近平与彭丽媛初见一面，彼此就认定了对方是与自己共度一生的人。', 'http://resource.gbxx123.com/book/epubs/2016/9/5/1473065176655/ops/chapter1.html', '7', '220', '2018-01-07 18:29:57', '2018-01-07 18:29:57', '1', '0');
INSERT INTO `t_discovery` VALUES ('660', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/9/5/1473043379092.jpg', '二十六年前的一次下乡', '1990年11月26日，寒风萧瑟，一部中巴车满载着福州市委、市政府和有关部门的干部从榕城开出，时任福州市委书记的习近平认真倾听着关于当前全市农业生产情况的汇报。', 'http://resource.gbxx123.com/book/epubs/2016/9/5/1473039966430/ops/chapter1.html', '7', '220', '2018-01-07 18:30:14', '2018-01-07 18:30:14', '1', '0');
INSERT INTO `t_discovery` VALUES ('661', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/8/26/1472201711470.jpg', '习大大排队买饭的往事', '在困难群众家品尝蒸土豆、为七旬老人端饭、在少年宫看孩子们踢足球、庆丰包子铺排队取餐、植树节和群众一起植树……十八大以来，习大大的一系列举动让我们看到了一个朴实崇检、亲民爱民的总书记。无论在地方还是在中央工作，他都与广大群众保持密切联系。', 'http://resource.gbxx123.com/book/epubs/2016/8/26/1472200380191/ops/chapter1.html', '7', '220', '2018-01-07 18:30:21', '2018-01-07 18:30:21', '1', '0');
INSERT INTO `t_discovery` VALUES ('662', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/8/23/1471914404056.jpg', '习大大下基层', '群众，在习近平心中有着最重的分量。基层，是他去的最多的地方。', 'http://resource.gbxx123.com/book/epubs/2016/8/23/1471913515643/ops/chapter1.html', '7', '220', '2018-01-07 18:30:28', '2018-01-07 18:30:28', '2', '0');
INSERT INTO `t_discovery` VALUES ('663', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2015/12/22/1450766565306.jpg', '习近平眼中最高尚的职业是什么?', '有这样一群人：他们每天迎接城市第一缕晨曦，无论严寒酷暑，日复一日；他们与垃圾为伴，为少数人的不文明埋单，点缀着城市的繁华；他们用自己的双手和汗水换来了街道的整洁，城市的美好……他们便是我们可爱的城市环卫工人!每逢节假日，便是环卫工人最忙最累的时候，年复一年，多少环卫工人在他们的岗位上迎接节日的到来。', 'http://resource.gbxx123.com/book/epubs/2015/12/22/1450763775776/ops/chapter1.html', '7', '220', '2018-01-07 18:30:35', '2018-01-07 18:30:35', '2', '0');
INSERT INTO `t_discovery` VALUES ('664', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2015/6/17/1434523679381.jpg', '这些年习大大吃过的家常饭', '2015年5月14日晚，习近平在西安设宴款待莫迪。晚8时左右，印度外交部发言人维卡斯·史瓦卢普更新推特晒出晚宴菜单。', 'http://resource.gbxx123.com/book/epubs/2015/6/17/1434511026242/ops/chapter1.html', '7', '220', '2018-01-07 18:30:54', '2018-01-07 18:30:54', '2', '0');
INSERT INTO `t_discovery` VALUES ('665', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2015/6/9/1433833544196.jpg', '七常委高考往事', '火机哪里不会点哪里妈妈再也不用担心我的学习，但对这种群众喜闻乐见的大戏还真是想想就有点儿小激动呢。', 'http://resource.gbxx123.com/book/epubs/2015/6/9/1433832864108/ops/chapter1.html', '7', '220', '2018-01-07 18:31:02', '2018-01-07 18:31:02', '2', '0');
INSERT INTO `t_discovery` VALUES ('666', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2015/6/8/1433741699878.jpg', '忆习近平：很低调 有点“土”', '20世纪80年代初期，由于工作关系，我和习近平同志在河北省正定县曾经同事。一起工作的日子，给我留下了难忘而美好的记忆。', 'http://resource.gbxx123.com/book/epubs/2015/6/8/1433740255343/ops/chapter1.html', '7', '220', '2018-01-07 18:31:16', '2018-01-07 18:31:16', '2', '0');
INSERT INTO `t_discovery` VALUES ('667', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2015/6/2/1433223273398.jpg', '习仲勋狱中见家人：已认不清习近平', '“文化大革命”开始后，康生伙同林彪、江青等人对习仲勋的迫害进一步升级。1966年5月，在康生的主持下，习仲勋专案组又搞出一份审查报告，报告中直接诬陷《刘志丹》一书是“习仲勋反党集团”蓄谋已久的阴谋。', 'http://resource.gbxx123.com/book/epubs/2015/6/2/1433210134130/ops/chapter1.html', '7', '220', '2018-01-07 18:31:31', '2018-01-07 18:31:31', '2', '0');
INSERT INTO `t_discovery` VALUES ('668', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2015/5/14/1431586497940.jpg', '习总家事：在家不让吃肉', '​习总和彭阿姨伉俪情深及故事，官媒及民间多有谈资。5月4日国共最高领导人会晤（即习朱会），饭桌聊天，才知习总“家教严”还真不是吹的。', 'http://resource.gbxx123.com/book/epubs/2015/5/14/1431587126501/ops/chapter1.html', '7', '220', '2018-01-07 18:31:44', '2018-01-07 18:31:44', '2', '0');
INSERT INTO `t_discovery` VALUES ('669', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2015/5/12/1431407954458.jpg', '彭丽媛赞习近平年轻时像“都教授”', '​算起来，1992年出生的习明泽今年23岁，正是大学毕业的年纪。', 'http://resource.gbxx123.com/book/epubs/2015/5/12/1431407584911/ops/chapter1.html', '7', '220', '2018-01-07 18:31:59', '2018-01-07 18:31:59', '2', '0');
INSERT INTO `t_discovery` VALUES ('670', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2015/5/9/1431179171978.jpg', '习近平六回正定', '有这样一个人，无论他身处何方，正定县人民始终惦记着他。', 'http://resource.gbxx123.com/book/epubs/2015/5/9/1431180579815/ops/chapter1.html', '7', '220', '2018-01-07 18:32:06', '2018-01-07 18:32:06', '2', '0');
INSERT INTO `t_discovery` VALUES ('671', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/10/21/1477029601431.jpg', '习近平鼓励实干苦干', '“一个人正如一只时钟，是以他的行动来定其价值的。”做任何事情，只有投入到实践中去，以持之以恒、滴水穿石的精神实干苦干，才能在激烈的竞争中脱颖而出、百炼成钢。', 'http://resource.gbxx123.com/book/epubs/2016/10/21/1477028585416/ops/chapter1.html', '7', '220', '2018-01-07 18:32:49', '2018-01-07 18:32:49', '3', '0');
INSERT INTO `t_discovery` VALUES ('672', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/3/2/1488444572704.jpg', '有个群众给习近平写了一首词', '习近平在福州任市委书记时首推“马上就办”的工作作风，为整顿当时政府机关办事慵懒的风气起到了十分重要作用。', 'http://resource.gbxx123.com/book/epubs/2017/3/2/1488442371253/ops/chapter1.html', '7', '220', '2018-01-07 18:32:55', '2018-01-07 18:32:55', '3', '0');
INSERT INTO `t_discovery` VALUES ('673', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/1417140150957/1417140150957.jpg', '低调律己，婚宴只办一桌', '习近平带头践行，下乡吃食堂，交伙食费。时任宁德电视新闻宣传站副站长、现任宁德电视台台长邢常葆曾多次跟随习近平下乡采访，20多年过去，他对一个细节仍记忆犹新。“有一次，到蕉城区虎贝乡调研，在乡政府食堂用餐，习近平同志交代秘书餐后要交1.5元的伙食费，但那位乡长不要。吃完饭后回到车上，习近平问秘书伙食费交了没有，秘书回答没有，被说了一顿。他赶紧跑回去交伙食费，拿收条。”', 'http://resource.gbxx123.com/book/epubs/1422866633004/ops/chapter1.html', '7', '220', '2018-01-07 18:33:01', '2018-01-07 18:33:01', '3', '0');
