INSERT INTO `t_discovery` VALUES ('682', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/4/1515035928798.jpg', '中华优秀传统文化', '中华优秀传统文化，是中华文明成果根本的创造力，是民族历史上道德传承、各种文化思想、精神观念形态的总体。', 'http://resource.gbxx123.com/book/epubs/2018/1/4/1515035893732/ops/chapter1.html', '7', '217', '2018-01-08 12:48:48', '2018-01-08 12:48:48', '3', '0');
INSERT INTO `t_discovery` VALUES ('683', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/29/1514517248385.jpg', '开放发展', '开放发展，就是顺应中国经济深度融入世界经济的趋势，奉行互利共赢的开放战略，坚持内外需协调、进出口平衡、引进来和走出去并重、引资和引技引智并举，发展更高层次的开放型经济，积极参与全球经济治理和公共产品供给，提高中国在全球经济治理中的制度性话语权，构建广泛的利益共同体。', 'http://resource.gbxx123.com/book/epubs/2017/12/29/1514517001309/ops/chapter1.html', '7', '217', '2018-01-08 12:48:53', '2018-01-08 12:48:53', '3', '0');
INSERT INTO `t_discovery` VALUES ('684', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/20/1513758696780.jpg', ' 军民融合发展战略', '军民融合就是把国防和军队现代化建设深深融入经济社会发展体系之中，全面推进经济、科技、教育、人才等各个领域的军民融合，在更广范围、更高层次、更深程度上把国防和军队现代化建设与经济社会发展结合起来，为实现国防和军队现代化提供丰厚的资源和可持续发展的后劲。', 'http://resource.gbxx123.com/book/epubs/2017/12/20/1513758259451/ops/chapter1.html', '7', '217', '2018-01-08 12:48:59', '2018-01-08 12:48:59', '4', '0');
INSERT INTO `t_discovery` VALUES ('685', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/18/1513582714191.jpg', '新型城镇化', '新型城镇化，指的是以城乡统筹、城乡一体、产业互动、节约集约、生态宜居、和谐发展为基本特征的城镇化，是大中小城市、小城镇、新型农村社区协调发展、互促共进的城镇化。', 'http://resource.gbxx123.com/book/epubs/2017/12/18/1513582457137/ops/chapter1.html', '7', '217', '2018-01-08 12:49:04', '2018-01-08 12:49:04', '4', '0');
INSERT INTO `t_discovery` VALUES ('686', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/14/1513220470983.jpg', '政治本色', '共产党人的政治本色，是共产党人政治生命的基因，是党的事业枝繁叶茂的根系。它集中体现为坚定理想信念、永远服务人民、坚持务实进取、保持艰苦奋斗等精神特质。对马克思主义的信仰、对社会主义和共产主义的信念，是共产党人的政治灵魂，是共产党人政治本色的首要内容。', 'http://resource.gbxx123.com/book/epubs/2017/12/14/1513220383746/ops/chapter1.html', '7', '217', '2018-01-08 12:49:09', '2018-01-08 12:49:09', '4', '0');
INSERT INTO `t_discovery` VALUES ('687', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/7/1512616685352.jpg', ' 功成不必在我', '功成不必在我，亦可为功不必在我，是指功绩、事情、事业的成功，没有必要看我一个人。可以理解这件事不是非我不可，也可以理解为一件事情的成功的必然因素不在于我，体现了一种宽广大度和高尚情怀。', 'http://resource.gbxx123.com/book/epubs/2017/12/7/1512616462057/ops/chapter1.html', '7', '217', '2018-01-08 12:49:17', '2018-01-08 12:49:17', '4', '0');
