INSERT INTO `t_discovery` VALUES ('694', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/11/1515632476397.jpg', '中央军委向武警部队授旗仪式在北京举行 习近平向武警部队授旗并致训词', '中央军委向武警部队授旗仪式1月10日在北京八一大楼举行。中共中央总书记、国家主席、中央军委主席习近平向武警部队授旗并致训词。', 'http://resource.gbxx123.com/book/epubs/2018/1/11/1515632275257/ops/chapter1.html', '7', '216', '2018-01-11 13:25:22', '2018-01-11 13:25:22', '3', '0');
INSERT INTO `t_discovery` VALUES ('695', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/9/1515458717899.jpg', '中共中央国务院隆重举行国家科学技术奖励大会 习近平出席大会并为最高奖获得者等颁奖', '中共中央、国务院1月8日上午在北京隆重举行国家科学技术奖励大会。党和国家领导人习近平、李克强、张高丽、王沪宁出席大会并为获奖代表颁奖。李克强代表党中央、国务院在大会上讲话。张高丽主持大会。', 'http://resource.gbxx123.com/book/epubs/2018/1/8/1515403858257/ops/chapter1.html', '7', '216', '2018-01-11 13:25:41', '2018-01-11 13:25:41', '3', '0');
INSERT INTO `t_discovery` VALUES ('696', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/11/1515632449807.jpg', '习近平集体会见北欧和波罗的海国家议长', '国家主席习近平1月10日在人民大会堂集体会见北欧和波罗的海国家议会领导人。芬兰议长洛赫拉、挪威议长托马森、冰岛议长西格富松、爱沙尼亚议长内斯托尔、拉脱维亚议长穆尔涅采、立陶宛议长普兰茨凯蒂斯、瑞典第一副议长芬内等参加会见。', 'http://resource.gbxx123.com/book/epubs/2018/1/11/1515632274261/ops/chapter1.html', '7', '216', '2018-01-11 13:25:50', '2018-01-11 13:25:50', '3', '0');
INSERT INTO `t_discovery` VALUES ('697', '55056', '1', '', null, 'http://xxzlres.xxzg123.com/images/km/10.jpg', '习近平讲故事', '《习近平讲故事》一书，共收入109则故事，分为对内篇和对外篇。对内篇包括廉政、品格、励志、治理等；对外篇侧重于人民友好、国家交往、文化融通、历史情感等。每则故事在引用原文之外，还配有“延伸阅读”，用以丰富故事细节，还原故事语境，让读者更好地体悟故事背后的改革发展之道、大国外交之道、修身为人之道。', 'http://resource.gbxx123.com/mindmap/2017/8/23/1503453423302/1503453423302.json', '5', '218', '2018-01-11 13:26:19', '2018-01-11 13:26:19', '3', '0');
INSERT INTO `t_discovery` VALUES ('698', '55064', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2016/12/15/1481793464195.jpg', '当年习近平工业发展有方略', '“银羊辞岁千祥聚，金猴闹春万象新。”1992年2月2日正值农历辛未年十二月二十九，除夕前夕。人们举家欢庆，幸福洋溢，好生热闹。而此时的福州市委书记习近平顾不上小家团圆，正忙着召开福州市工交工作会议呢。', 'http://resource.gbxx123.com/book/epubs/2016/12/15/1481792778545/ops/chapter1.html', '7', '220', '2018-01-12 07:14:04', '2018-01-12 07:14:04', '3', '0');
