INSERT INTO `t_discovery` VALUES ('703', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/10/1515546037771.jpg', '习近平同法国总统马克龙举行会谈 两国元首一致同意推动紧密持久的中法全面战略伙伴关系行稳致远', '国家主席习近平1月9日在人民大会堂同法国总统马克龙举行会谈。', 'http://resource.gbxx123.com/book/epubs/2018/1/10/1515545927453/ops/chapter1.html', '7', '216', '2018-01-12 15:56:08', '2018-01-12 15:56:08', '3', '0');
INSERT INTO `t_discovery` VALUES ('704', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/9/1515458717899.jpg', '中共中央国务院隆重举行国家科学技术奖励大会 习近平出席大会并为最高奖获得者等颁奖', '中共中央、国务院1月8日上午在北京隆重举行国家科学技术奖励大会。党和国家领导人习近平、李克强、张高丽、王沪宁出席大会并为获奖代表颁奖。李克强代表党中央、国务院在大会上讲话。张高丽主持大会。', 'http://resource.gbxx123.com/book/epubs/2018/1/8/1515403858257/ops/chapter1.html', '7', '216', '2018-01-12 15:56:14', '2018-01-12 15:56:14', '3', '0');
INSERT INTO `t_discovery` VALUES ('705', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/9/1515458651483.jpg', '习近平会见法国总统马克龙', '国家主席习近平1月8日在钓鱼台国宾馆会见来华进行国事访问的法国总统马克龙。', 'http://resource.gbxx123.com/book/epubs/2018/1/9/1515458551099/ops/chapter1.html', '7', '216', '2018-01-12 15:56:20', '2018-01-12 15:56:20', '4', '0');
INSERT INTO `t_discovery` VALUES ('706', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/5/1515158964017.jpg', '习近平：以时不我待只争朝夕的精神投入工作 开创新时代中国特色社会主义事业新局面 ', '新进中央委员会的委员、候补委员和省部级主要领导干部学习贯彻习近平新时代中国特色社会主义思想和党的十九大精神研讨班5日上午在中央党校开班。', 'http://resource.gbxx123.com/book/epubs/2018/1/5/1515484993695/ops/chapter1.html', '11', '216', '2018-01-12 15:56:26', '2018-01-12 15:56:26', '4', '0');
INSERT INTO `t_discovery` VALUES ('707', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/3/1514986002815.jpg', '中央军委举行2018年开训动员大会 习近平向全军发布训令 ', '新年伊始，万象更新，全军上下厉兵秣马，练兵正当时。3日上午，中央军委隆重举行2018年开训动员大会，中共中央总书记、国家主席、中央军委主席习近平向全军发布训令，号召全军贯彻落实党的十九大精神和新时代党的强军思想，全面加强实战化军事训练，全面提高打赢能力。', 'http://resource.gbxx123.com/book/epubs/2018/1/3/1515484738031/ops/chapter1.html', '11', '216', '2018-01-12 15:56:32', '2018-01-12 15:56:32', '4', '0');
INSERT INTO `t_discovery` VALUES ('708', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/5/1515114643364.jpg', '习近平：大抓实战化军事训练 聚力打造精锐作战力量', '中共中央总书记、国家主席、中央军委主席习近平1月3日视察中部战区陆军某师，强调要认真贯彻党的十九大精神，贯彻新时代党的强军思想，大抓实战化军事训练，深入推进数字化部队建设管理和作战运用创新，聚力打造精锐作战力量。', 'http://resource.gbxx123.com/book/epubs/2018/1/5/1515484879033/ops/chapter1.html', '11', '216', '2018-01-12 15:56:38', '2018-01-12 15:56:38', '4', '0');
INSERT INTO `t_discovery` VALUES ('709', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/3/1514942939958.jpg', '习近平同南非总统祖马就中南建交20周年互致贺电', '国家主席习近平1月1日同南非总统祖马互致贺电，热烈庆祝中南建交20周年。', 'http://resource.gbxx123.com/book/epubs/2018/1/3/1514946121506/ops/chapter1.html', '11', '216', '2018-01-12 15:56:43', '2018-01-12 15:56:43', '4', '0');
INSERT INTO `t_discovery` VALUES ('710', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/1/1514779706637.jpg', '国家主席习近平发表二〇一八年新年贺词 ', '新年前夕，国家主席习近平通过中国国际广播电台、中央人民广播电台、中央电视台、中国国际电视台（中国环球电视网）和互联网，发表了二〇一八年新年贺词。', 'http://resource.gbxx123.com/book/epubs/2018/1/1/1514945865945/ops/chapter1.html', '11', '216', '2018-01-12 15:56:51', '2018-01-12 15:56:51', '4', '0');
INSERT INTO `t_discovery` VALUES ('711', '55039', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/12/7/1512637647003.jpg', '习近平致信祝贺首届“南南人权论坛”开幕强调：以合作促发展 以发展促人权 不断提高人权保障水平', '12月7日，首届“南南人权论坛”在京开幕。国家主席习近平发来贺信，对论坛的举办表示热烈的祝贺，强调全球人权事业发展离不开广大发展中国家共同努力，希望国际社会本着公正、公平、开放、包容的精神，尊重并反映发展中国家人民的意愿，促进发展中国家人民享有更加充分的人权，实现全人类共同繁荣发展。', 'http://resource.gbxx123.com/book/epubs/2017/12/7/1513750250029/ops/chapter1.html', '11', '216', '2018-01-12 15:57:02', '2018-01-12 15:57:02', '5', '0');
