INSERT INTO `t_discovery` VALUES ('717', '55474', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/10/31/1509438914592.jpg', '向习近平学“用人之道”', '从隋灭的前车之鉴与唐兴的为政经验中，唐太宗总结得出：“为政之要，惟在得人。”《资治通鉴》对为政用人问题亦主张：“为治之要，莫先于用人。”纵览古今中外国运之兴衰，无不与“用人”有着密切联系。由此可见，政以才治，国以人兴，千秋大业，贵在用人。习近平总书记对“用人”的重视由来已久，十八大以来，习近平总书记更是就干部选任问题发表了大量重要论述。今天，“学习大军”就和大家一同去学学习近平总书记的“用人之道”。', 'http://resource.gbxx123.com/book/epubs/2017/10/31/1509438439387/ops/chapter1.html', '7', '220', '2018-01-13 09:12:25', '2018-01-13 09:12:25', '2', '0');
INSERT INTO `t_discovery` VALUES ('718', '55288', '1', '点赞', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/12/1515740952647.jpg', '中共中央政治局召开会议 讨论拟提请十九届二中全会审议的文件 中共中央总书记习近平主持会议', '中共中央政治局1月12日召开会议，研究修改宪法部分内容的建议。中共中央总书记习近平主持会议。', 'http://resource.gbxx123.com/book/epubs/2018/1/12/1515740912110/ops/chapter1.html', '7', '216', '2018-01-13 09:32:42', '2018-01-13 09:32:42', '3', '0');
INSERT INTO `t_discovery` VALUES ('719', '55288', '1', '千秋大业，贵在用人啊，，加油，我的祖国', null, 'http://resource.gbxx123.com/site/image/courseware/2017/10/31/1509438914592.jpg', '向习近平学“用人之道”', '从隋灭的前车之鉴与唐兴的为政经验中，唐太宗总结得出：“为政之要，惟在得人。”《资治通鉴》对为政用人问题亦主张：“为治之要，莫先于用人。”纵览古今中外国运之兴衰，无不与“用人”有着密切联系。由此可见，政以才治，国以人兴，千秋大业，贵在用人。习近平总书记对“用人”的重视由来已久，十八大以来，习近平总书记更是就干部选任问题发表了大量重要论述。今天，“学习大军”就和大家一同去学学习近平总书记的“用人之道”。', 'http://resource.gbxx123.com/book/epubs/2017/10/31/1509438439387/ops/chapter1.html', '7', '220', '2018-01-13 09:33:36', '2018-01-13 09:33:36', '2', '0');
INSERT INTO `t_discovery` VALUES ('720', '55477', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/7/17/1500276472942.jpg', '习近平“夜找书店”的故事', '在福建，习近平先后在宁德、福州担任党委一把手多年，如何加强党的建设，是他始终关注的问题，也是着力探索的问题。其中，思想建设、班子建设、基层组织建设是他重要的抓手。', 'http://resource.gbxx123.com/book/epubs/2017/7/17/1500276366100/ops/chapter1.html', '7', '220', '2018-01-13 09:35:58', '2018-01-13 09:35:58', '4', '0');
INSERT INTO `t_discovery` VALUES ('721', '55474', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2015/4/23/1429756395296.jpg', '习近平给父亲的一封生日贺信', '2001年10月15日，家人为习仲勋在深圳举办88岁寿宴，这也是习家人难得的一次大团聚，唯独缺席时任福建省长的习近平。', 'http://resource.gbxx123.com/book/epubs/2015/4/23/1429756875923/ops/chapter1.html', '7', '220', '2018-01-13 09:45:41', '2018-01-13 09:45:41', '2', '0');
INSERT INTO `t_discovery` VALUES ('722', '55474', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2015/4/11/1428753847870.jpg', '一套军装的故事', '上世纪90年代，在任福建省委副书记、代省长和省长期间，习近平曾兼任福建预备役高炮师第一政委长达7年。一位当时服役于预备役高炮师的老兵回忆起些许往事，感慨万千。', 'http://resource.gbxx123.com/book/epubs/2015/4/11/1428748239021/ops/chapter1.html', '7', '220', '2018-01-13 09:50:45', '2018-01-13 09:50:45', '2', '1');
INSERT INTO `t_discovery` VALUES ('723', '55474', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2015/5/20/1432107105757.jpg', '人生本平等，职业无贵贱', '人生本平等，职业无贵贱。', 'http://resource.gbxx123.com/book/epubs/2015/5/20/1432099452757/ops/chapter1.html', '7', '216', '2018-01-13 10:26:42', '2018-01-13 10:26:42', '2', '1');
INSERT INTO `t_discovery` VALUES ('724', '55474', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2015/5/21/1432175449706.jpg', '为子孙后代留下天蓝、地绿、水清的生产生活环境', '值此生态文明贵阳国际论坛2013年年会开幕之际，我谨代表中国政府和人民，并以我个人的名义，向会议的召开致以热烈的祝贺!向出席会议的各国元首、政府首脑、联合国机构负责人以及专家学者、企业家等各方嘉宾，表示热烈的欢迎!', 'http://resource.gbxx123.com/book/epubs/2015/5/20/1432099339258/ops/chapter1.html', '7', '216', '2018-01-13 10:31:02', '2018-01-13 10:31:02', '1', '1');
INSERT INTO `t_discovery` VALUES ('725', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/12/1515740952647.jpg', '中共中央政治局召开会议 讨论拟提请十九届二中全会审议的文件 中共中央总书记习近平主持会议', '中共中央政治局1月12日召开会议，研究修改宪法部分内容的建议。中共中央总书记习近平主持会议。', 'http://resource.gbxx123.com/book/epubs/2018/1/12/1515740912110/ops/chapter1.html', '7', '216', '2018-01-14 14:37:26', '2018-01-14 14:37:26', '0', '0');
INSERT INTO `t_discovery` VALUES ('726', '55056', '1', '', null, 'http://resource.gbxx123.com/site/default/imageone.jpg', '叶剑英的红岩诗篇', '​2017年是叶剑英元帅诞辰120周年。在抗日战争时期和解放战争初期，叶剑英作为中共代表团代表、中共中央南方局常委兼军事组组长、第十八集团军参谋长、政治协商会议中共代表，曾暂驻重庆，结庐红岩，协助周恩来领导党在南方国民党统治区和部分沦陷区的工作。叶剑英在红岩的战斗时光，亦成为他革命生涯中辉煌灿烂的篇章。叶剑英创作的多首诗词中，更是如实记录了那段风起云涌、波澜壮阔的红岩往事。', 'http://resource.gbxx123.com/book/epubs/2017/9/11/1505110642783/ops/chapter1.html', '7', '232', '2018-01-14 14:37:38', '2018-01-14 14:37:38', '0', '0');
INSERT INTO `t_discovery` VALUES ('727', '55056', '1', '', null, 'http://resource.gbxx123.com/site/default/imageone.jpg', '“铁杆球迷”邓小平', '邓小平对足球运动情有独钟，是个铁杆足球迷。早在20世纪20年代，初次走出国门的邓小平在法国勤工俭学时，就被足球比赛深深地吸引了。新中国成立后，邓小平对中国足球事业提出了许多富有建设性的建议。', 'http://resource.gbxx123.com/book/epubs/2017/9/11/1505110642394/ops/chapter1.html', '7', '232', '2018-01-14 14:37:46', '2018-01-14 14:37:46', '0', '0');
