INSERT INTO `t_discovery` VALUES ('747', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/16/1516063806159.jpg', '中共中央政治局常务委员会召开会议 中共中央总书记习近平主持会议', '中共中央政治局常务委员会1月15日全天召开会议，听取全国人大常委会、国务院、全国政协、最高人民法院、最高人民检察院党组工作汇报，听取中央书记处工作报告。中共中央总书记习近平主持会议并发表重要讲话。', 'http://resource.gbxx123.com/book/epubs/2018/1/16/1516063712472/ops/chapter1.html', '7', '216', '2018-01-18 16:14:16', '2018-01-18 16:14:16', '2', '0');
INSERT INTO `t_discovery` VALUES ('748', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/12/1515748107723.jpg', '住房制度', '住房制度是涉及全体人民生活的一项重要经济制度，是指包括有关住房的建设、分配、交接、管理等方面的法律、法规及政策等调整有关方面的关系并约束其行为的规范，是社会为居民提供满足其基本生活所需住房的制度安排，关系到一国的国计民生和社会发展。', 'http://resource.gbxx123.com/book/epubs/2018/1/12/1515747912375/ops/chapter1.html', '7', '217', '2018-01-18 16:14:38', '2018-01-18 16:14:38', '3', '0');
