INSERT INTO `t_discovery` VALUES ('750', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2017/4/20/1492670971170.jpg', '习近平：这一手不硬不行!', '俗话说：“民不容贪,法不护腐。”贪污腐败是罪大恶极之事，人人恨之入骨;贪官污吏是罪孽深重之徒，人人得而诛之。在反腐倡廉建设中，各机关各单位都无法置身事外、袖手旁观。而作为侦查、监督各类刑事案件，维护国家、社会安定和谐的检察机关,其第一位工作就是要反贪污贿赂，且这份工作必须做得坚决彻底，不留余地。习近平也早就说过，这一手不硬不行!', 'http://resource.gbxx123.com/book/epubs/2017/4/20/1492668789069/ops/chapter1.html', '7', '220', '2018-01-18 16:15:48', '2018-01-18 16:15:48', '3', '0');
