INSERT INTO `t_discovery` VALUES ('774', '55580', '1', '打赢也要自身硬', null, 'http://resource.gbxx123.com/site/image/courseware/2017/5/19/1495182232712.jpg', ' 打铁还需自身硬', '“打铁还需自身硬”意思是说，作为一个打铁的人，必须“自身硬”，才能打出坚固耐用的铁器。即正人先要正己，自己不正就不能正人，自己不硬就打不出好铁。引申来看，就是无论做什么事情，首先要明白自己为完成使命和任务必须首先具备何种素质，如果自己的本领不过硬，那么就无法完成既定任务；同时也要有正确的思想和价值观，要有凛然正气。', 'http://resource.gbxx123.com/book/epubs/2017/5/19/1495182129486/ops/chapter1.html', '7', '217', '2018-01-19 22:08:09', '2018-01-19 22:08:09', '2', '1');
