INSERT INTO `t_discovery` VALUES ('778', '55575', '1', '好好学习天天向上 书中自有黄金屋', null, 'http://resource.gbxx123.com/site/image/courseware/2016/12/7/1481099964870.jpg', '习近平说：要学习、学习、再学习', '一日不书，百事荒芜。读书是修身养性的关键；学习是自我提升的前提。一个人如果不读书、不学习，就像一个空壳，难以进步，毫无用处。习近平的爱学习、爱读书，众所周知。早在任福州市委书记时，他就强调，要加强党建理论学习，推进党的自身建设。', 'http://resource.gbxx123.com/book/epubs/2016/12/7/1481098539537/ops/chapter1.html', '7', '220', '2018-01-20 09:27:21', '2018-01-20 09:27:21', '4', '0');
