INSERT INTO `t_discovery` VALUES ('783', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/19/1516339557069.jpg', '作风建设', '作风建设，是指为了端正党组织和党员的思想作风、工作作风和生活作风，树立与党的性质和宗旨相适应的良好风尚而开展的系列工作。党的十八大以来，习近平多次指出，党的作风就是党的形象，关系人心向背，关系党的生死存亡。党的作风正，人民的心气顺，党和人民就能同甘共苦。', 'http://resource.gbxx123.com/book/epubs/2018/1/19/1516332322815/ops/chapter1.html', '7', '217', '2018-01-21 09:06:19', '2018-01-21 09:06:19', '3', '0');
INSERT INTO `t_discovery` VALUES ('784', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/12/1515748107723.jpg', '住房制度', '住房制度是涉及全体人民生活的一项重要经济制度，是指包括有关住房的建设、分配、交接、管理等方面的法律、法规及政策等调整有关方面的关系并约束其行为的规范，是社会为居民提供满足其基本生活所需住房的制度安排，关系到一国的国计民生和社会发展。', 'http://resource.gbxx123.com/book/epubs/2018/1/12/1515747912375/ops/chapter1.html', '7', '217', '2018-01-21 09:06:27', '2018-01-21 09:06:27', '3', '0');
