INSERT INTO `t_discovery` VALUES ('792', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/23/1516688593054.jpg', '创新型国家', '　创新型国家是指将科技创新作为基本战略，以科技创新为经济社会发展核心驱动力，大幅度提高科技创新能力，形成日益强大竞争优势的国家。主要表现为：整个社会对创新活动的投入较高，重要产业的国际技术竞争力较强，投入产出的绩效较高，科技进步和技术创新在产业发展和国家的财富增长中起重要作用。', 'http://resource.gbxx123.com/book/epubs/2018/1/23/1516688357264/ops/chapter1.html', '7', '217', '2018-01-27 14:00:41', '2018-01-27 14:00:41', '6', '0');
