INSERT INTO `t_discovery` VALUES ('797', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/26/1516950155346.jpg', '习近平讲故事：我们叫龙的传人', '“龙的传人”是中国人的自称。龙的形成记录了古代民族发展的聚合过程，起着维系和向心的作用。龙文化已成为东方文化重要的组成部分，为人类文明做出了巨大贡献，中国人常引以为豪。', 'http://resource.gbxx123.com/book/epubs/2018/1/26/1516949784066/ops/chapter1.html', '7', '220', '2018-02-01 07:11:51', '2018-02-01 07:11:51', '2', '0');
