INSERT INTO `t_discovery` VALUES ('802', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/26/1516948630820.jpg', '重情重义习近平', '联接中南海与普通百姓，拉近中国与世界的距离——习近平的情与义博大深厚。新华社《学习进行时》查阅近年来习近平的活动图片，选数幅推出，同你一起领略总书记的情义无国界。', 'http://resource.gbxx123.com/book/epubs/2018/1/26/1516948515394/ops/chapter1.html', '7', '220', '2018-02-05 13:04:51', '2018-02-05 13:04:51', '2', '0');
INSERT INTO `t_discovery` VALUES ('803', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/2/14/1518611558969.jpg', '中共中央国务院举行春节团拜会 习近平发表重要讲话 ', '中共中央、国务院2月14日上午在人民大会堂举行2018年春节团拜会。中共中央总书记、国家主席、中央军委主席习近平发表重要讲话，代表党中央、国务院，向全国各族人民，向香港特别行政区同胞、澳门特别行政区同胞、台湾同胞和海外侨胞拜年。', 'http://resource.gbxx123.com/book/epubs/2018/2/14/1518611279983/ops/chapter1.html', '7', '216', '2018-02-17 10:03:41', '2018-02-17 10:03:41', '2', '0');
INSERT INTO `t_discovery` VALUES ('804', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/2/7/1517971477072.jpg', '国家公园体制', '国家公园是自然保护区最主要的形式之一，是自然环境优美、资源独特，具有区域典型性、代表性的保护价值大的自然区域，同时也是协调自然资源保护与利用的有效途径。党的十八届三中全会通过的《中共中央关于全面深化改革若干重大问题的决定》首次提出“建立国家公园体制”。', 'http://resource.gbxx123.com/book/epubs/2018/2/7/1517971080100/ops/chapter1.html', '7', '217', '2018-02-24 05:17:44', '2018-02-24 05:17:44', '2', '0');
