INSERT INTO `t_discovery` VALUES ('819', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/3/12/1520858430371.jpg', '习近平：扎扎实实推进军民融合深度发展 为实现中国梦强军梦提供强大动力和战略支撑 ', '中共中央总书记、国家主席、中央军委主席习近平12日上午在出席十三届全国人大一次会议解放军和武警部队代表团全体会议时强调，实施军民融合发展战略是构建一体化国家战略体系和能力的必然选择，也是实现党在新时代的强军目标的必然选择，要加强战略引领，加强改革创新，加强军地协同，加强任务落实，努力开创新时代军民融合深度发展新局面，为实现中国梦强军梦提供强大动力和战略支撑。', 'http://resource.gbxx123.com/book/epubs/2018/3/12/1520858208502/ops/chapter1.html', '7', '216', '2018-03-17 17:45:58', '2018-03-17 17:45:58', '1', '0');
INSERT INTO `t_discovery` VALUES ('820', '55056', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/3/12/1520837726827.jpg', '家庭建设', '​国是千万家，家是最小国。我国有3.6亿个家庭，家庭是社会的细胞，是社会文明教养、德行培育和家风传承的第一站。家庭不和谐，社会难和谐；家庭不发展，社会难发展；家庭不幸福，社会难幸福。', 'http://resource.gbxx123.com/book/epubs/2018/3/12/1520837378977/ops/chapter1.html', '7', '217', '2018-03-26 12:35:38', '2018-03-26 12:35:38', '3', '0');
INSERT INTO `t_discovery` VALUES ('821', '55669', '1', '赞！', null, 'http://resource.gbxx123.com/site/image/courseware/2018/3/30/1522374507397.jpg', '习近平同纳米比亚总统根哥布举行会谈 两国元首一致决定 建立中纳全面战略合作伙伴关系', '国家主席习近平29日在人民大会堂同纳米比亚总统根哥布举行会谈。两国元首一致决定，建立中纳全面战略合作伙伴关系。', 'http://resource.gbxx123.com/book/epubs/2018/3/30/1522374386232/ops/chapter1.html', '7', '216', '2018-03-30 11:47:14', '2018-03-30 11:47:14', '1', '0');
INSERT INTO `t_discovery` VALUES ('822', '55669', '1', '分享到哪了？', null, 'http://resource.gbxx123.com/site/image/courseware/2018/3/30/1522374507397.jpg', '习近平同纳米比亚总统根哥布举行会谈 两国元首一致决定 建立中纳全面战略合作伙伴关系', '国家主席习近平29日在人民大会堂同纳米比亚总统根哥布举行会谈。两国元首一致决定，建立中纳全面战略合作伙伴关系。', 'http://resource.gbxx123.com/book/epubs/2018/3/30/1522374386232/ops/chapter1.html', '7', '216', '2018-03-30 11:49:03', '2018-03-30 11:49:03', '1', '0');
INSERT INTO `t_discovery` VALUES ('823', '55669', '1', '！！', null, 'http://resource.gbxx123.com/site/image/courseware/2018/3/29/1522290033906.jpg', '改革强军战略', '改革是决定当代中国命运的关键一招，也是决定我军发展壮大、制胜未来的关键一招。党的十八届三中全会对深化国防和军队改革作出部署，单独作为一个部分纳入全面深化改革的总盘子，上升为党的意志和国家行为。', 'http://resource.gbxx123.com/book/epubs/2018/3/29/1522289837051/ops/chapter1.html', '7', '217', '2018-03-30 11:56:07', '2018-03-30 11:56:07', '1', '1');
INSERT INTO `t_discovery` VALUES ('824', '55669', '1', '！！！', null, 'http://xxzlres.xxzg123.com/images/km/2.jpg', '政府工作报告：2017年3月5日在第十二届全国人民代表大会第五次会议上', '2017年3月5日,李克强总理在第十二届全国人民代表大会第五次会议上作政府工作报告，回顾2016年工作情况与成果，展望2017年那工作愿景。', 'http://resource.gbxx123.com/mindmap/2017/3/7/1488895444004/1488895444004.json', '5', '218', '2018-03-30 11:58:36', '2018-03-30 11:58:36', '3', '0');
INSERT INTO `t_discovery` VALUES ('825', '55056', '1', '', null, 'http://xxzlres.xxzg123.com/images/ueditor/image/20180327/1522116336473058799.bmp', '跑步10000米、女干部战斗驾驶……这个部队训练开挂了！', '跑步10000米、女干部战斗驾驶……这个部队训练开挂了！', 'http://mp.weixin.qq.com/s/GecM50N_Lw-yVRoJ0Fwuew', '12', '248', '2018-04-02 18:46:01', '2018-04-02 18:46:01', '4', '0');
INSERT INTO `t_discovery` VALUES ('826', '55671', '1', '习大大威武', null, 'http://resource.gbxx123.com/site/image/courseware/2018/1/26/1516949810948.jpg', '这件民生小事体现习近平大情怀', '这是一项民生难点，也是体现文明进步的尺度。它与人人相关，习近平总书记时时牵挂心间。', 'http://resource.gbxx123.com/book/epubs/2018/1/26/1516949784315/ops/chapter1.html', '7', '220', '2018-04-13 16:05:57', '2018-04-13 16:05:57', '2', '1');
INSERT INTO `t_discovery` VALUES ('827', '55423', '1', '', null, 'http://resource.gbxx123.com/site/image/courseware/2018/4/13/1523587630041.jpg', '开放型经济新体制', '　开放型经济是与封闭型经济相对立的概念，是一种经济体制模式。在开放型经济中，要素、商品与服务可以较自由地跨国界流动，从而实现最优资源配置和最高经济效率。开放经济强调把国内经济和整个国际市场联系起来，尽可能充分的参加国际分工，同时在国际分工中发挥出本国经济的比较优势。', 'http://resource.gbxx123.com/book/epubs/2018/4/13/1523587435716/ops/chapter1.html', '7', '217', '2018-04-15 10:50:27', '2018-04-15 10:50:27', '1', '0');
INSERT INTO `t_discovery` VALUES ('828', '55657', '1', '立行立改立标准', null, null, '心系打赢立说立行', '心系打赢立说立行', 'http://xxzlres.xxzg123.com/article/wa/zy/2017/9/9/150496281220421118.html', '7', '1', '2018-04-16 08:02:46', '2018-04-16 08:02:46', '3', '0');
INSERT INTO `t_discovery` VALUES ('829', '54716', '1', '', null, 'http://xxzlres.xxzg123.com/images/km/6.jpg', '决胜全面建成小康社会 夺取新时代中国特色社会主义伟大胜利', '十九大报告内容。', 'http://resource.gbxx123.com/mindmap/2017/11/15/1510714230007/1510714230007.json', '5', '218', '2018-04-17 17:23:18', '2018-04-17 17:23:18', '2', '0');
INSERT INTO `t_discovery` VALUES ('830', '54716', '1', '', null, 'http://xxzlres.xxzg123.com/images/km/9.jpg', '问道：改革开放以来的社会思潮与青年思想政治教育研究', '《问道——改革开放以来的社会思潮与青年思想政治教育研究》一书是教育部人文社会科学重点研究基地清华大学高校德育研究中心重大项目“改革开放以来的社会思潮与青年思想政治教育研究”的研究成果，由清华大学马克思主义学院林泰教授任主编，清华大学人文学院冯虞章教授任副主编。全书从总体上把握改革开放以来社会思潮发展演变的历史脉络，探讨改革开放以来社会思潮形成发展的一般规律；把从总体上把握社会思潮的斗争和对个别社会思潮的专章分析相结合，从纷纭复杂的社会思潮中选择若干在改革开放过程中反复出现、事关改革开放方向道路，对人们特别是青年大学生影响较大的社会思潮，分十章从理论上进行分析；把引领社会思潮的理论研究与思想政治教育、特别是高校对青年大学生的思想政治工作的研究相结合，探索用社会主义核心价值体系引领社会思潮的科学内涵和有效途径。全书以改革开放以来的社会思潮与青年思想政治教育研究为主题，对中国特色社会主义理论、道路与否定中国特色社会主义思潮的交锋进行梳理、介绍、分析和评论，努力体现党性和科学性、理论性和可读性、辩论性和资料性的统一，是一部坚持社会主义先进文化前进方向，用社会主义核心价值体系引领社会思潮的力作。', 'http://resource.gbxx123.com/mindmap/2017/9/21/1505991880134/1505991880134.json', '5', '218', '2018-04-18 11:49:47', '2018-04-18 11:49:47', '2', '0');
