-- ----------------------------
-- Table structure for `t_chatgroup`
-- ----------------------------
DROP TABLE IF EXISTS `t_chatgroup`;
CREATE TABLE `t_chatgroup` (
  `group_id` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '环信服务端生成',
  `group_name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '群组名称',
  `group_type` int(11) NOT NULL DEFAULT '0' COMMENT '群组类型(1/分组讨论,2/学习补课,3/主题热议)',
  `group_desc` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '群组描述信息',
  `public` int(11) DEFAULT '1' COMMENT '是否公开群,默认公开',
  `max_users` int(11) DEFAULT '200' COMMENT '群组成员最大数（包括群主），值为数值类型，默认值200，最大值2000',
  `approval` int(11) DEFAULT '0' COMMENT '加入公开群是否需要批准，默认值是false（加入公开群不需要群主批准）,私有群必须为true',
  `owner` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '群组的管理员',
  `hot_id` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '主题热议唯一标识符,党校接口传入',
  `origin_url` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '原文地址,指向群组详情内容',
  `attach_num` int(11) DEFAULT '0' COMMENT '附件数量,学习补课类型时才有值,默认0',
  `create_time` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '创建时间',
  `hot_type` int(11) DEFAULT NULL COMMENT '热议资源类型',
  `hot_res_id` int(11) DEFAULT NULL COMMENT '热议资源栏目id',
  PRIMARY KEY (`group_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=DYNAMIC;

